VERSION="8.7.2" # EOL release
MAINLINE_URL="http://kernel.ubuntu.com/~kernel-ppa/mainline"
KERNEL_TYPE="generic"
SUPPORTED_OS=("Ubuntu" "Kubuntu" "Lubuntu" "Lubuntu-Next" "Ubuntu-Budgie" "Ubuntu-GNOME" "Ubuntu-MATE" "Xubuntu" "Mint" "neon" "BackBox" "Peppermint" "Ubuntu-Studio")
LONG_FLAGS_WITH_ARGUMENTS=("kernel" "repository" "erase" "package" "local-package" "download" "file" "boot" "storage" "iso" "work-directory" "command" "output" "grub" "key" "template")
LONG_FLAGS_WITHOUT_ARGUMENTS=("help" "version" "check" "eol" "update" "dist-upgrade" "upgrade" "interactive" "debug")
SERVER_FLAG=("server")
PROCESSOR_FLAGS=("apollo" "atom")
ROLLING_FLAGS=("rolling-release" "rolling-release-hwe" "rolling-release-hwe-edge" "rolling-proposed" "rolling-proposed-hwe" "rolling-proposed-hwe-edge" "rolling-testing" "rolling-testing-hwe" "rolling-testing-hwe-edge" "rolling-unstable" "rolling-unstable-hwe" "rolling-unstable-hwe-edge")
ROLLING_LIST=("rolling-list")
LONG_FLAGS=("${LONG_FLAGS_WITH_ARGUMENTS[@]}" "${LONG_FLAGS_WITHOUT_ARGUMENTS[@]}" "${SERVER_FLAG[@]}" "${PROCESSOR_FLAGS[@]}" "${ROLLING_FLAGS[@]}" "${ROLLING_LIST[@]}")
NEEDS_AN_ARGUMENT=("k" "r" "e" "p" "l" "d" "f" "b" "s" "i" "w" "c" "o" "g")
DOES_NOT_NEED_AN_ARGUMENT=("${LONG_FLAGS_WITHOUT_ARGUMENTS[@]}" "${SERVER_FLAG[@]}" "${PROCESSOR_FLAGS[@]}" "${ROLLING_FLAGS[@]}" "${ROLLING_LIST[@]}")
# based on /usr/share/distro-info/ubuntu.csv
RELEASE_CODENAME=("trusty" "utopic" "vivid" "wily" "xenial" "yakkety" "zesty" "artful" "bionic" "cosmic" "disco" "eoan" "focal" "groovy" "hirsute" "impish")
RELEASE_VERSION=("14.04" "14.10" "15.04" "15.10" "16.04" "16.10" "17.04" "17.10" "18.04" "18.10" "19.04" "19.10" "20.04" "20.10" "21.04" "21.10")
RELEASE_EOL=("2019-04-25" "2015-07-23" "2016-02-04" "2016-07-28" "2021-04-21" "2017-07-20" "2018-01-13" "2018-07-19" "2023-04-26" "2019-07-18" "2020-01-23" "2020-07-17" "2025-04-23" "2021-07-22" "2022-01-20" "2022-07-14")
CWD="$(pwd)"
WIP="${CWD}/isorespin"
ISORESPIN_LOGFILE="${CWD}/isorespin.log"
GUI=false
GUI_BOX_CONTENT=""
GUI_BOX_BORDER=""

trap 'FORCED_EXIT' SIGHUP SIGINT SIGTERM

function CLOSE_DISPLAY_BOX {
	if [ -n "${GUI_BOX_CONTENT}" ] && [ "$(ps -p ${GUI_BOX_CONTENT} -o comm --no-header)" == "zenity" ]; then
		sudo kill -9 "${GUI_BOX_CONTENT}" > /dev/null 2>&1
		GUI_BOX_CONTENT=""
	fi
	if [ -n "${GUI_BOX_BORDER}" ] && [ "$(ps -p ${GUI_BOX_BORDER} -o comm --no-header)" == "sleep" ]; then
		sudo kill -9 "${GUI_BOX_BORDER}" > /dev/null 2>&1
		GUI_BOX_BORDER=""
	fi
}

function DISPLAY_WARNING {
	DISPLAY_TEXT="$1"
	CLOSE_DISPLAY_BOX
	"${GUI}" && zenity --info --title="isorespin.sh" --text="${DISPLAY_TEXT}" 2> /dev/null
	"${GUI}" || echo "WARNING: ${DISPLAY_TEXT}"
	if [ -f "${ISORESPIN_LOGFILE}" ]; then
		echo "WARNING: ${DISPLAY_TEXT}" >> "${ISORESPIN_LOGFILE}" 2> /dev/null
	fi
}

function DISPLAY_MESSAGE {
	DISPLAY_TEXT="$1"
	CLOSE_DISPLAY_BOX
	"${GUI}" && zenity --info --title="isorespin.sh" --text="${DISPLAY_TEXT}" 2> /dev/null
	"${GUI}" || echo "$(basename ${0}): ${DISPLAY_TEXT}"
	if [ -f "${ISORESPIN_LOGFILE}" ]; then
		echo "${DISPLAY_TEXT}" >> "${ISORESPIN_LOGFILE}" 2> /dev/null
	fi
}

function DISPLAY_PROGRESS {
	DISPLAY_TEXT="$1"
	CLOSE_DISPLAY_BOX
	if "${GUI}"; then
		sleep infinity | zenity --progress --title="isorespin.sh" --text="${DISPLAY_TEXT}" --auto-close --no-cancel --pulsate 2> /dev/null &
		GUI_BOX_BORDER=$(jobs -l | (read GUI_BOX_BORDER; echo "$GUI_BOX_BORDER" | awk '{print $2}'))
		GUI_BOX_CONTENT=$(jobs -l | sed 1d | (read GUI_BOX_CONTENT; echo "$GUI_BOX_CONTENT" | awk '{print $1}'))
		disown "${GUI_BOX_BORDER}"
	fi
	"${GUI}" || echo "${DISPLAY_TEXT}"
}

function UMOUNT {
	MOUNT_POINT=$1
	sudo sync && sudo sync && sudo umount ${MOUNT_POINT} > /dev/null 2>&1 || sudo sync && sudo sync && sudo umount -lf ${MOUNT_POINT} > /dev/null 2>&1
	if $(sudo fuser -mM ${MOUNT_POINT} > /dev/null 2>&1); then
		sleep 10
	fi
	sudo sync && sudo sync && sudo umount ${MOUNT_POINT} > /dev/null 2>&1 || sudo sync && sudo sync && sudo umount -lf ${MOUNT_POINT} > /dev/null 2>&1
	if $(fuser -mM ${MOUNT_POINT} > /dev/null 2>&1); then DISPLAY_PROGRESS "$(basename ${0}): Cannot unmount '${MOUNT_POINT}' ... exiting." && MESSY_EXIT; fi
}

function CLEAN_EXIT {
	CLOSE_DISPLAY_BOX
	cd "${CWD}"
	if [ -d "${WIP}" ]; then
		sudo rm -rf "${WIP}"
	fi
	[ -f "${CWD}"/isorespin.tpl ] && sudo rm -f "${CWD}"/isorespin.tpl
	sudo rm -f "${CWD}"/.isorespin.sh.lock
	exit 1
}

function UNCLEAN_EXIT {
	CLOSE_DISPLAY_BOX
	cd "${CWD}"
	sudo rm -f "${CWD}"/.isorespin.sh.lock
	exit 1
}

function MESSY_EXIT {
	CLOSE_DISPLAY_BOX
	cd "${CWD}"
	if [ -d "${WIP}" ]; then
		cd "${WIP}"
		UMOUNT mnt
		cd "${CWD}"
		sudo rm -rf "${WIP}"
	fi
	[ -f "${CWD}"/isorespin.tpl ] && sudo rm -f "${CWD}"/isorespin.tpl
	sudo rm -f "${CWD}"/.isorespin.sh.lock
	exit 1
}

function DIRTY_EXIT {
	CLOSE_DISPLAY_BOX
	cd "${CWD}"
	[ -f "${CWD}"/isorespin.tpl ] && sudo rm -f "${CWD}"/isorespin.tpl
	sudo rm -f "${CWD}"/.isorespin.sh.lock
	exit 1
}

function FORCED_EXIT {
	CLOSE_DISPLAY_BOX
	DISPLAY_MESSAGE "Forced exit ... ISO not created."
	cd "${CWD}"
	if [ -d "${WIP}" ]; then
		cd "${WIP}"
		UMOUNT mnt
		UMOUNT iso-chroot/dev/pts
		UMOUNT iso-chroot/dev
		UMOUNT iso-chroot/sys
		UMOUNT iso-chroot/proc
		cd "${CWD}"
		sudo rm -rf "${WIP}"
	fi
	[ -f "${CWD}"/isorespin.tpl ] && sudo rm -f "${CWD}"/isorespin.tpl
	sudo rm -f "${CWD}"/.isorespin.sh.lock
	exit -1
}

function CHROOT_EXIT {
	cd "${CWD}"
	if [ -d "${WIP}" ]; then
		cd "${WIP}"
		UMOUNT iso-chroot/dev/pts
		UMOUNT iso-chroot/dev
		UMOUNT iso-chroot/sys
		UMOUNT iso-chroot/proc
	fi
	CLEAN_EXIT
}

function USAGE {
	echo "Usage: $(basename ${0}) [ -h | -v | --check | --rolling-list ]"
	echo "       $(basename ${0}) -i <ISO> [ [ -u | -k <kernel> ] | [ --dist-upgrade | --upgrade ] | ..."
	echo "       $(basename ${0}) ... [ --rolling-release | --rolling-release-hwe | --rolling-release-hwe-edge | --rolling-proposed | --rolling-proposed-hwe | --rolling-proposed-hwe-edge | ..."
	echo "       $(basename ${0}) ... --rolling-testing | --rolling-testing-hwe | --rolling-testing-hwe-edge | --rolling-unstable | --rolling-unstable-hwe | --rolling-unstable-hwe-edge ] | ..."
	echo "       $(basename ${0}) ... -b [ GRUB | GRUB-32 | GRUB-64 | rEFInd | Linuxium ] | -g [ \"\" | \"<kernel boot parameter> ... \" ] | -s [ <size>MB | <size>GB ] | -w <directory> | ..."
	echo "       $(basename ${0}) ... --key \"<repo> ... \" | -r \"<repo> ... \" | -p \"<pkg> ... \" | -l \"<pkg.deb> ... \" | -e \"<pkg> ... \" | -d \"<pkg> ... \" | -f [ \"<file> | <directory> ... \" ] | ..."
	echo "       $(basename ${0}) ... -c \"<cmd> ... \" | -o [ \"<file> | <directory> ... \" ] | -t <template configuration file> | --apollo | --atom | --server | --interactive | --debug ]"
}

function USE_GUI_TO_GENERATE_CMDLINE {
	TITLE="isorespin.sh (version ${VERSION})"
	while true
	do
		OPTIONS=$(zenity --list --title="isorespin.sh (version ${VERSION})" --text "Select option" --height=340 --width=600 --checklist --hide-header \
			--column ""	--column "" \
			TRUE		"ISO" \
			FALSE		"Add frequently used options for Intel Atom (Bay Trail/Cherry Trail) or Intel Apollo processors" \
			FALSE		"Upgrade kernel" \
			FALSE		"Add repositories" \
			FALSE		"Include packages" \
			FALSE		"Include local packages" \
			FALSE		"Add files" \
			FALSE		"Add directories" \
			FALSE		"Add persistence" \
			FALSE		"Advanced Options" \
			--separator=":" --ok-label="Continue" --cancel-label="Quit" 2> /dev/null)
		if [ -z "${OPTIONS}" ]; then
			rm -f ${ISORESPIN_LOGFILE}
			DIRTY_EXIT
		fi
		OIFS="${IFS}"
		IFS=':' FLAGS=(${OPTIONS})
		IFS="${OIFS}"
		CMDLINE=""
		for FLAG in "${FLAGS[@]}"
		do
			case ${FLAG} in
				"ISO")
					ISO=$(zenity --file-selection --file-filter='ISO (*.iso) | *.iso' --title="Select the ISO to respin" 2> /dev/null)
					if [ -z "${ISO}" ]; then
						break
					fi
					CMDLINE+=" -i ${ISO}"
					;;
				"Add frequently used options for Intel Atom (Bay Trail/Cherry Trail) or Intel Apollo processors")
					PROCESSOR=$(zenity --list --title="isorespin.sh" --text "Make a selection" --height=160 --width=550 --radiolist --column "" --column "" --hide-header TRUE "Add frequently used options for an Intel Atom (Bay Trail or Cherry Trail) processor" FALSE "Add frequently used options for an Intel Apollo processor" 2> /dev/null)
					if [ "${PROCESSOR}" == "Add frequently used options for an Intel Atom (Bay Trail or Cherry Trail) processor" ]; then
						CMDLINE+=" --atom"
					else
						CMDLINE+=" --apollo"
					fi
					;;
				"Upgrade kernel")
					CHOICE=$(zenity --list --title="isorespin.sh" --text "Make a selection" --radiolist --column "" --column "" --hide-header TRUE "Upgrade kernel to latest available version" FALSE "Upgrade kernel to a specific version" FALSE "Upgrade to a rolling kernel" 2> /dev/null)
					if [ "${CHOICE}" == "Upgrade to a rolling kernel" ]; then
						ROLLING=$(zenity --list --title="isorespin.sh" --text "Make a selection" --height=390 --width=300 --radiolist --column "" --column "" --hide-header \
						FALSE "Rolling release kernel" \
						FALSE "Rolling release-hwe kernel" \
						FALSE "Rolling release-hwe-edge kernel" \
						FALSE "Rolling proposed kernel" \
						FALSE "Rolling proposed-hwe kernel" \
						FALSE "Rolling proposed-hwe-edge kernel" \
						FALSE "Rolling testing kernel" \
						FALSE "Rolling testing-hwe kernel" \
						FALSE "Rolling testing-hwe-edge kernel" \
						FALSE "Rolling unstable kernel" \
						FALSE "Rolling unstable-hwe kernel" \
						FALSE "Rolling unstable-hwe-edge kernel" \
						2> /dev/null)
						ROLLING=${ROLLING#Rolling }
						CMDLINE+=" --rolling-${ROLLING% kernel}"
					elif [ "${CHOICE}" == "Upgrade kernel to a specific version" ]; then
						KERNEL=$(zenity --entry --title="isorespin.sh" --text="Enter kernel version (e.g. v4.12-rc1)" 2> /dev/null)
						CMDLINE+=" -k ${KERNEL}"
					else
						CMDLINE+=" -u"
					fi
					;;
				"Add repositories")
					MORE=0
					while [ "${MORE}" == "0" ]
					do
						REPOSITORY=$(zenity --entry --title="isorespin.sh" --text="Enter repository to add to the ISO" 2> /dev/null)
						CMDLINE+=" -r \"${REPOSITORY}\""
						zenity --question --title="Add repositories" --text="Would you like to add another?" 2> /dev/null
						MORE=$?
					done
					;;
				"Include packages")
					MORE=0
					while [ "${MORE}" == "0" ]
					do
						PACKAGES=$(zenity --entry --title="isorespin.sh" --text="Enter packages to install to the ISO" 2> /dev/null)
						CMDLINE+=" -p \"${PACKAGES}\""
						zenity --question --title="Include packages" --text="Would you like to add another?" 2> /dev/null
						MORE=$?
					done
					;;
				"Include local packages")
					MORE=0
					while [ "${MORE}" == "0" ]
					do
						LOCAL_PACKAGE=$(zenity --file-selection --file-filter='Local Package (*.deb) | *.deb' --title="Select local package to install to the ISO" 2> /dev/null)
						if [ -z "${LOCAL_PACKAGE}" ]; then
							break
						fi
						CMDLINE+=" -l \"${LOCAL_PACKAGE}\""
						zenity --question --title="Include local packages" --text="Would you like to add another?" 2> /dev/null
						MORE=$?
					done
					;;
				"Add files")
					MORE=0
					while [ "${MORE}" == "0" ]
					do
						FILE=$(zenity --file-selection --file-filter='Files (*.*) | *.*' --title="Select file to add to the ISO" 2> /dev/null)
						if [ -z "${FILE}" ]; then
							break
						fi
						CMDLINE+=" -f \"${FILE}\""
						zenity --question --title="Add files" --text="Would you like to add another?" 2> /dev/null
						MORE=$?
					done
					;;
				"Add directories")
					MORE=0
					while [ "${MORE}" == "0" ]
					do
						FILE=$(zenity --file-selection --directory --title="Select directory to add to the ISO" 2> /dev/null)
						if [ -z "${FILE}" ]; then
							break
						fi
						CMDLINE+=" -f \"${FILE}\""
						zenity --question --title="Add directories" --text="Would you like to add another?" 2> /dev/null
						MORE=$?
					done
					;;
				"Add persistence")
					STORAGE=$(zenity --scale --title="isorespin.sh" --text "Size of persistence partition in MBs" --min-value=128 --max-value=2048 --value=128 --step 64 2> /dev/null)
					CMDLINE+=" -s ${STORAGE}MB"
					;;
				"Advanced Options")
					OPTIONS=$(zenity --list --title="isorespin.sh (version ${VERSION})" --text "Select 'advanced' option" --height=295 --width=400 --checklist --hide-header \
						--column ""	--column "" \
						FALSE		"Work directory" \
						FALSE		"Download packages" \
						FALSE		"Purge packages" \
						FALSE		"Add commands" \
						FALSE		"Output files/directories" \
						FALSE		"Select bootloader/bootmanager" \
						FALSE		"Delete initial kernel boot parameters" \
						FALSE		"Add additional kernel boot parameters" \
						--separator=":" --ok-label="Continue" --cancel-label="Quit" 2> /dev/null)
					if [ -z "${OPTIONS}" ]; then
						continue
					fi
					OIFS="${IFS}"
					IFS=':' FLAGS=(${OPTIONS})
					IFS="${OIFS}"
					for FLAG in "${FLAGS[@]}"
					do
						case ${FLAG} in
							"Select bootloader/bootmanager")
								CHOICE=$(zenity --list --title="isorespin.sh" --text "Make a selection" --radiolist --column "" --column "" --hide-header TRUE "GRUB bootloader" FALSE "rEFInd bootmanager" FALSE "Linuxium bootscript" 2> /dev/null)
								if [ "${CHOICE}" == "Linuxium bootscript" ]; then
									CMDLINE+=" -b Linuxium"
								elif [ "${CHOICE}" == "rEFInd bootmanager" ]; then
									CMDLINE+=" -b rEFInd"
								elif [ "${CHOICE}" == "32-bit GRUB bootloader" ]; then
									CMDLINE+=" -b GRUB-32"
								elif [ "${CHOICE}" == "64-bit GRUB bootloader" ]; then
									CMDLINE+=" -b GRUB-64"
								else
									CMDLINE+=" -b GRUB"
								fi
								;;
							"Work directory")
								WORK_DIRECTORY=$(zenity --file-selection --directory --title="Select the work directory" 2> /dev/null)
								if [ -z "${WORK_DIRECTORY}" ]; then
									break
								fi
								CMDLINE+=" -w \"${WORK_DIRECTORY}\""
								;;
							"Download packages")
								MORE=0
								while [ "${MORE}" == "0" ]
								do
									PACKAGES=$(zenity --entry --title="isorespin.sh" --text="Enter packages to download to the ISO" 2> /dev/null)
									CMDLINE+=" -d \"${PACKAGES}\""
									zenity --question --title="Download packages" --text="Would you like to add another?" 2> /dev/null
									MORE=$?
								done
								;;
							"Add commands")
								MORE=0
								while [ "${MORE}" == "0" ]
								do
									COMMANDS=$(zenity --entry --title="isorespin.sh" --text="Enter command to run on the ISO" 2> /dev/null)
									CMDLINE+=" -c \"${COMMANDS}\""
									zenity --question --title="Add commands" --text="Would you like to add another?" 2> /dev/null
									MORE=$?
								done
								;;
							"Purge packages")
								MORE=0
								while [ "${MORE}" == "0" ]
								do
									PURGE_PACKAGES=$(zenity --entry --title="isorespin.sh" --text="Enter packages to purge from the ISO" 2> /dev/null)
									CMDLINE+=" -e \"${PURGE_PACKAGES}\""
									zenity --question --title="Purge packages" --text="Would you like to purge another?" 2> /dev/null
									MORE=$?
								done
								;;
							"Output files/directories")
								MORE=0
								while [ "${MORE}" == "0" ]
								do
									OUTPUT_FILE=$(zenity --entry --title="isorespin.sh" --text="Enter file or directory to output from the ISO" 2> /dev/null)
									CMDLINE+=" -o \"${OUTPUT_FILE}\""
									zenity --question --title="Output files/directories" --text="Would you like to add another?" 2> /dev/null
									MORE=$?
								done
								;;
							"Delete initial kernel boot parameters")
								CMDLINE+=" -g \"\""
								;;
							"Add additional kernel boot parameters")
								MORE=0
								while [ "${MORE}" == "0" ]
								do
									KERNEL_BOOT_PARAMETER=$(zenity --entry --title="isorespin.sh" --text="Enter kernel boot parameter to add to the ISO" 2> /dev/null)
									CMDLINE+=" -g \"${KERNEL_BOOT_PARAMETER}\""
									zenity --question --title="Add kernel boot parameters" --text="Would you like to add another?" 2> /dev/null
									MORE=$?
								done
								;;
						esac
					done
					;;
			esac
		done
		if [ -n "${ISO}" ]; then
			zenity --question --text="${CMDLINE}" --title="Would you like to run 'isorespin.sh' with the following options?" 2> /dev/null
			RUN_SCRIPT=$?
			if [ ${RUN_SCRIPT} != 0 ]; then
				rm -f ${ISORESPIN_LOGFILE}
				DIRTY_EXIT
			fi
			break
		fi
	done
	CMDLINE="${CMDLINE:1}"
}

function CHECK_WHETHER { for MATCHED_FLAG in "${@:2}"; do [[ "${1}" == "${MATCHED_FLAG}" ]] && return 0; done && return 1; }

function GET_LONG_FLAG { for VALUE in $(seq 0 $((${#LONG_FLAGS[@]}-1))); do [[ "${FLAG:1:1}" == "${LONG_FLAGS[${VALUE}]:0:1}" ]] && LONG_FLAG="--${LONG_FLAGS[${VALUE}]}" && return 0; done; LONG_FLAG="" && return 1; }

function PARSE_CMDLINE_OPTION {
	if [ -n "${README_FLAG}" ]; then
		case ${README_FLAG} in
			"--local-package"|"--file"|"--iso")
					for READLINK_README_ARGUMENT in ${README_ARGUMENT}
					do
						READLINK_README_ARGUMENT=${READLINK_README_ARGUMENT#\"}
						READLINK_README_ARGUMENT=${READLINK_README_ARGUMENT%\"}
						FULL_PATHNAME_README_ARGUMENT+=" $(readlink -f ${READLINK_README_ARGUMENT} 2> /dev/null)"
					done
					if [ "${README_ARGUMENT:0:1}" == '"' ]; then
						README_ARGUMENT='"'${FULL_PATHNAME_README_ARGUMENT:1}'"'
					else
						README_ARGUMENT=${FULL_PATHNAME_README_ARGUMENT:1}
					fi
					FULL_PATHNAME_README_ARGUMENT=""
					;;
		esac
		if [ "${README_FLAG}" != "--work-directory" ]; then
			README_ARGUMENT=${README_ARGUMENT%% }
			if [ -n "${README_ARGUMENT}" ]; then
				README_ARGUMENT=${README_ARGUMENT}
			elif [ "${README_FLAG}" == "--grub" ]; then
				README_ARGUMENT='""'
			fi
			README[${README_ARRAY}]="${README_FLAG} ${README_ARGUMENT}"
			((README_ARRAY++))
		fi
	fi
}

function EXPAND_CMDLINE_TEMPLATES {
	QUOTED_CMDLINE=""
	for EXPAND_OPTION in $@
	do
		if [ "${EXPAND_OPTION:0:1}" == "-" ]; then
			if [ "${EXPAND_OPTION:1:1}" != "-" ]; then
				FLAG=${EXPAND_OPTION}
				GET_LONG_FLAG
				if [ -n "${LONG_FLAG}" -a "${LONG_FLAG}" == "--template" ]; then
					TEMPLATE=true
				else
					TEMPLATE=false
					QUOTED_CMDLINE+=" ${EXPAND_OPTION}"
				fi
			else
				if [ "${EXPAND_OPTION}" == "--template" ]; then
					TEMPLATE=true
				else
					TEMPLATE=false
					QUOTED_CMDLINE+=" ${EXPAND_OPTION}"
				fi
			fi
			EXPAND_ARGUMENT=""
		else
			EXPAND_ARGUMENT+="${EXPAND_OPTION} "
			if ${TEMPLATE}; then
				TEMPLATE_CONFIGURATION=${EXPAND_ARGUMENT%% }
				if [ -z "${TEMPLATE_CONFIGURATION}" ]; then
					DISPLAY_MESSAGE "Missing template configuration file."
					DIRTY_EXIT
				elif [ ! -s "${TEMPLATE_CONFIGURATION}" ]; then
					DISPLAY_MESSAGE "Template configuration file '${TEMPLATE_CONFIGURATION}' not found."
					DIRTY_EXIT
				else
					while read TEMPLATE_CONFIGURATION_OPTION
					do
						QUOTED_CMDLINE+=" ${TEMPLATE_CONFIGURATION_OPTION}"
					done < ${TEMPLATE_CONFIGURATION}
				fi
			else
				QUOTED_CMDLINE+=" ${EXPAND_OPTION}"
			fi
		fi
	done
	QUOTED_CMDLINE="${QUOTED_CMDLINE## }"
}

function CHECK_CMDLINE {
	${GUI} && DISPLAY_PROGRESS "Checking invocation ..."
	ISORESPIN_SCRIPT=$(readlink -f ${0})
	ISORESPIN_COMMAND="$@"
	echo "Script '${0}' (version: ${VERSION}) called with '${ISORESPIN_COMMAND}' ..." >> ${ISORESPIN_LOGFILE}
	README[0]="$(basename ${0}) (version: ${VERSION})"
	README_ARRAY=1
	PARSE_ARGUMENT=false
	PART_OF_COMMENT=false
	for README_OPTION in "$@"
	do
		if ! ${PART_OF_COMMENT}; then
			if [ "${README_OPTION:0:1}" == "-" ]; then
				README_FLAG=${README_OPTION}
				if [ "${README_OPTION:0:2}" != "--" ]; then
					FLAG=${README_OPTION}
					GET_LONG_FLAG
					if [ -n "${LONG_FLAG}" ]; then
						README_FLAG=${LONG_FLAG}
					fi
				fi
				if (CHECK_WHETHER "${README_FLAG:2}" "${DOES_NOT_NEED_AN_ARGUMENT[@]}"); then
					README_ARGUMENT=""
					PARSE_CMDLINE_OPTION
					PARSE_ARGUMENT=false
					continue
				fi
				README_ARGUMENT=""
				PARSE_ARGUMENT=true
				continue
			fi
		fi
		if ${PARSE_ARGUMENT}; then
			if [ "${README_OPTION:0:1}" == '"' ]; then
				PART_OF_COMMENT=true
			fi
			if [ "${README_OPTION:$((${#README_OPTION}-1)):1}" == '"' ]; then
				PART_OF_COMMENT=false
			fi
			README_ARGUMENT+="${README_OPTION} "
			if ! ${PART_OF_COMMENT}; then
				PARSE_CMDLINE_OPTION
				PARSE_ARGUMENT=false
			fi
		fi
	done
	if ${PARSE_ARGUMENT}; then
		PARSE_CMDLINE_OPTION
	fi
	UPDATE_INITRAMFS_ENVIRONMENT=""
	INTERACTIVE=false
	DEBUG=false
	I_OPTION=false
	UPDATE_KERNEL=false
	U_OPTION=false
	K_OPTION=false
	PURGE_PACKAGE=false
	APT_PURGE_OPTION="--autoremove"
	E_OPTION=false
	PURGE_ARRAY=0
	ADD_KEY=false
	KEY_OPTION=false
	KEY_ARG=false
	KEY_ARRAY=0
	ADD_REPOSITORY=false
	R_OPTION=false
	REPOSITORY_ARRAY=0
	ADD_PACKAGE=false
	P_OPTION=false
	PACKAGE_ARRAY=0
	REMOVE_ROLLING_REPOSITORY=false
	ROLLING_KERNEL_OPTION=false
	ADD_LOCAL_PACKAGE=false
	L_OPTION=false
	LOCAL_PACKAGE_ARRAY=0
	DIST_UPGRADE=false
	UPGRADE=false
	UPGRADE_COMMAND=""
	ADD_DOWNLOAD=false
	D_OPTION=false
	DOWNLOAD_ARRAY=0
	ADD_FILE=false
	F_OPTION=false
	FILE_ARRAY=0
	ADD_COMMAND=false
	C_OPTION=false
	COMMAND_ARRAY=0
	EXTRACT_FILE=false
	O_OPTION=false
	OUTPUT_FILE_ARRAY=0
	S_OPTION=false
	ADD_PERSISTENCE=false;
	B_OPTION=false
	BOOTLOADER=""
	PERSISTENCE=""
	USE_GRUB_BOOTLOADER=true
	BOOT=grub
	USE_REFIND_BOOTMANAGER=false
	USE_LINUXIUM_BOOTSCRIPT=false
	ADD_KERNEL_BOOT_PARAMETER=false
	KERNEL_BOOT_PARAMETER=""
	DELETE_KERNEL_BOOT_PARAMETERS=false
	W_OPTION=false
	DIRECTORY_ARRAY=0
	SERVER_OPTION=false
	TARGET_PROCESSOR_OPTION=false
	FLAG_FOUND=false
	ARGUMENT_FOUND=true
	MULTIPLE_ARGUMENTS=false;
	MULTIPLE=""
	EMBEDDED_QUOTE=false
	ISORESPIN_CHECKSUMS="isorespin.md5sums"
	OVERRIDE_EOL=false
	for VALUE in $(seq 0 $((${#LONG_FLAGS[@]}-1)))
	do
		SHORT_FLAGS[${VALUE}]="${LONG_FLAGS[${VALUE}]:0:1}"
	done
	for EACH_OPTION_IN_CMDLINE in $(seq 1 $#)
	do
		OPTION=${@:${EACH_OPTION_IN_CMDLINE}:1}
		if [ -z "${OPTION}" ]; then
			echo "Blank"
			continue
		fi
		# flag
		if ! ${MULTIPLE_ARGUMENTS} && [ "${OPTION:0:1}" == '-' ]; then
			if ! ${ARGUMENT_FOUND}; then
				if [ -z "${LONG_FLAG}" ]; then
					GET_LONG_FLAG
				fi
				if [ "${LONG_FLAG}" == "--key" ]; then
					DISPLAY_MESSAGE "An argument must be specified when using '${LONG_FLAG}'."
				else
					DISPLAY_MESSAGE "An argument must be specified when using '${FLAG}' or '${LONG_FLAG}'."
				fi
				DIRTY_EXIT
			elif [ "${OPTION:1:1}" == '-' ] ; then
				if (! CHECK_WHETHER "${OPTION:2}" "${LONG_FLAGS[@]}") ; then
					DISPLAY_MESSAGE "Invalid option '${OPTION}'."
					USAGE
					rm -f ${ISORESPIN_LOGFILE}
					DIRTY_EXIT
				fi
				SHORT_FLAG="${OPTION:2:1}"
			else
				if (! CHECK_WHETHER "${OPTION:1}" "${SHORT_FLAGS[@]}"); then
					DISPLAY_MESSAGE "Invalid option '${OPTION}'."
					USAGE
					rm -f ${ISORESPIN_LOGFILE}
					DIRTY_EXIT
				fi
				SHORT_FLAG="${OPTION:1}"
			fi
			FLAG="-${SHORT_FLAG}"
			LONG_FLAG=""
			FLAG_FOUND=true
			ARGUMENT_FOUND=false
			case "${SHORT_FLAG}" in
				"h")
					OPTION_HELP
					;;
				"v")
					OPTION_VERSION
					;;
				"e")	# eOL
					if [ "${OPTION}" == "--eol" ]; then
						LONG_FLAG="--eol"
						OVERRIDE_EOL=true
					fi
					FLAG_FOUND=false
					ARGUMENT_FOUND=true
					;;
				"c")	# cOMMAND or cHECK
					if [ "${OPTION}" != "-c" -a "${OPTION}" != "--command" ]; then
						OPTION_VERSION_CHECK
					else
						NEXT_OPTION_IN_CMDLINE=$((EACH_OPTION_IN_CMDLINE+1))
					fi
					;;
				"u")	# uPDATE or uPGRADE
					if [ "${OPTION}" == "--upgrade" ]; then
						LONG_FLAG="--upgrade"
						OPTION_UPGRADE
					else
						OPTION_UPDATE
					fi
					FLAG_FOUND=false
					ARGUMENT_FOUND=true
					;;
				"a")	# aTOM or aPOLLO
					TARGET_PROCESSOR=${OPTION:2}
					TARGET_PROCESSOR=${TARGET_PROCESSOR,,}
					OPTION_TARGET_PROCESSOR
					FLAG_FOUND=false
					ARGUMENT_FOUND=true
					;;
				"s")	# sERVER
					if [ "${OPTION}" == "--server" ]; then
						OPTION_SERVER
						FLAG_FOUND=false
						ARGUMENT_FOUND=true
					fi
					;;
				"r")	# rEPOSITORY or rOLLING
					if [ "${OPTION}" != "-r" -a "${OPTION}" != "--repository" ]; then
						ROLLING=${OPTION:2}
						ROLLING=${ROLLING,,}
						if ( ! ROLLING_FLAG "${ROLLING}" "${ROLLING_FLAGS[@]}" ); then
							if [ "${ROLLING}" == "rolling-list" ]; then
								OPTION_ROLLING_LIST
							else
								DISPLAY_MESSAGE "Rolling must be one of '${ROLLING_FLAGS[*]}'."
								DIRTY_EXIT
							fi
						else
							OPTION_ROLLING_KERNEL
							FLAG_FOUND=false
							ARGUMENT_FOUND=true
						fi
					else
						R_OPTION=true
					fi
					;;
				"k")	# kERNEL or kEY
					if [ "${OPTION}" == "--key" ]; then
						LONG_FLAG="--key"
						KEY_OPTION=true
						KEY_ARG=true
					fi
					;;
				"d")	# dOWNLOAD or dEBUG or dIST-UPGRADE
					if [ "${OPTION}" == "--debug" ]; then
						LONG_FLAG="--debug"
						DEBUG=true
						FLAG_FOUND=false
						ARGUMENT_FOUND=true
					elif [ "${OPTION}" == "--dist-upgrade" ]; then
						OPTION_DIST_UPGRADE
						FLAG_FOUND=false
						ARGUMENT_FOUND=true
					fi
					;;
				"i")	# iNTERACTIVE
					if [ "${OPTION}" == "--interactive" ]; then
						LONG_FLAG="--interactive"
						INTERACTIVE=true
						FLAG_FOUND=false
						ARGUMENT_FOUND=true
					fi
					;;
				*)
					NEXT_OPTION_IN_CMDLINE=$((EACH_OPTION_IN_CMDLINE+1))
					;;
			esac
		# argument
		else
			if ! ${MULTIPLE_ARGUMENTS}; then
				# ""
				if [ "${#OPTION}" -eq 0 ] || [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' -a "${#OPTION}" -eq 2 ]; then
					if (CHECK_WHETHER "${SHORT_FLAG}" "${NEEDS_AN_ARGUMENT[@]}"); then
						# exception for '-g ""' which is valid
						if [ "${SHORT_FLAG}" == 'g' ]; then
							ARGUMENT_FOUND=true
						else
							ARGUMENT_FOUND=false
							break
						fi
					fi
				# "OPTION"
				elif [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					OPTION=${OPTION/#\"/ }
					OPTION=${OPTION/%\"/ }
					ARGUMENT_FOUND=true
				# "OPTION ...
				elif [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" != '"' ]; then
					MULTIPLE_ARGUMENTS=true;
					MULTIPLE=${OPTION:1:${#OPTION}}
				else
					ARGUMENT_FOUND=true
				fi
			else
				# ... "OPTION" ...
				if [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-2)):1}" != '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					MULTIPLE+=" ${OPTION}"
				# ... "OPTION ...
				elif [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" != '"' ]; then
					EMBEDDED_QUOTE=true
					MULTIPLE+=" ${OPTION}"
				# ... OPTION" ...
				elif ${EMBEDDED_QUOTE} && [ "${OPTION:0:1}" != '"' -a "${OPTION:$((${#OPTION}-2)):1}" != '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					EMBEDDED_QUOTE=false
					MULTIPLE+=" ${OPTION}"
				# ... OPTION"
				elif ! ${EMBEDDED_QUOTE} && [ "${OPTION:0:1}" != '"' -a "${OPTION:$((${#OPTION}-2)):1}" != '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					MULTIPLE+=" ${OPTION:0:$((${#OPTION}-1))}"
					MULTIPLE_ARGUMENTS=false
					ARGUMENT_FOUND=true
					OPTION=${MULTIPLE}
				# ... OPTION""
				elif ${EMBEDDED_QUOTE} && [ "${OPTION:0:1}" != '"' -a "${OPTION:$((${#OPTION}-2)):1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					MULTIPLE+=" ${OPTION:0:$((${#OPTION}-1))}"
					EMBEDDED_QUOTE=false
					MULTIPLE_ARGUMENTS=false
					ARGUMENT_FOUND=true
					OPTION=${MULTIPLE}
				# ... "OPTION"""
				elif ${EMBEDDED_QUOTE} && [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-2)):1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					MULTIPLE+=" ${OPTION:0:$((${#OPTION}-1))}"
					EMBEDDED_QUOTE=false
					MULTIPLE_ARGUMENTS=false
					ARGUMENT_FOUND=true
					OPTION=${MULTIPLE}
				# ... "OPTION""
				elif ! ${EMBEDDED_QUOTE} && [ "${OPTION:0:1}" == '"' -a "${OPTION:$((${#OPTION}-2)):1}" == '"' -a "${OPTION:$((${#OPTION}-1)):1}" == '"' ]; then
					MULTIPLE+=" ${OPTION:0:$((${#OPTION}-1))}"
					MULTIPLE_ARGUMENTS=false
					ARGUMENT_FOUND=true
					OPTION=${MULTIPLE}
				# ... OPTION ...
				else
					MULTIPLE+=" ${OPTION}"
				fi
			fi
			if ! ${MULTIPLE_ARGUMENTS}; then
				if ! ${FLAG_FOUND} || ! (CHECK_WHETHER "${SHORT_FLAG}" "${NEEDS_AN_ARGUMENT[@]}"); then
					DISPLAY_MESSAGE "Option not specified for '${OPTION}'."
					DIRTY_EXIT
				fi
				case "${FLAG}" in
					"-k")
						if ${KEY_ARG}; then
							LONG_FLAG="key"
							KEYS[${KEY_ARRAY}]="${OPTION}"
							((KEY_ARRAY++))
							KEY_ARG=false
						else
							LONG_FLAG="kernel"
							MAINLINE_BRANCH="${OPTION}"
							OPTION_KERNEL
						fi
						;;
					"-r")
						if ${R_OPTION}; then
							LONG_FLAG="repository"
							REPOSITORIES[${REPOSITORY_ARRAY}]="${OPTION}"
							((REPOSITORY_ARRAY++))
						fi
						;;
					"-e")
						LONG_FLAG="erase"
						PURGE_PACKAGES[${PURGE_ARRAY}]="${OPTION}"
						((PURGE_ARRAY++))
						E_OPTION=true
						;;
					"-p")
						LONG_FLAG="package"
						PACKAGES[${PACKAGE_ARRAY}]="${OPTION}"
						((PACKAGE_ARRAY++))
						P_OPTION=true
						;;
					"-l")
						LONG_FLAG="local-package"
						LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]="${OPTION}"
						((LOCAL_PACKAGE_ARRAY++))
						L_OPTION=true
						;;
					"-d")
						LONG_FLAG="download"
						DOWNLOADS[${DOWNLOAD_ARRAY}]="${OPTION}"
						((DOWNLOAD_ARRAY++))
						D_OPTION=true
						;;
					"-f")
						LONG_FLAG="file"
						FILES[${FILE_ARRAY}]="${OPTION}"
						((FILE_ARRAY++))
						F_OPTION=true
						;;
					"-b")
						LONG_FLAG="boot"
						BOOT="${OPTION}"
						OPTION_BOOT
						;;
					"-s")
						LONG_FLAG="storage"
						STORAGE="${OPTION}"
						OPTION_STORAGE
						;;
					"-i")
						LONG_FLAG="iso"
						ISO="${OPTION}"
						OPTION_ISO
						;;
					"-w")
						LONG_FLAG="work-directory"
						WORK_DIRECTORY="${OPTION}"
						OPTION_WORK
						;;
					"-c")
						LONG_FLAG="command"
						COMMANDS[${COMMAND_ARRAY}]="${OPTION}"
						((COMMAND_ARRAY++))
						C_OPTION=true
						;;
					"-o")
						LONG_FLAG="output"
						OUTPUT_FILES[${OUTPUT_FILE_ARRAY}]="${OPTION}"
						((OUTPUT_FILE_ARRAY++))
						O_OPTION=true
						;;
					"-g")
						LONG_FLAG="grub"
						if [ "${OPTION:0:1}" == " " ]; then
							OPTION="${OPTION# }"
						fi
						if [ "${OPTION: -1}" == " " ]; then
							OPTION="${OPTION% }"
						fi
						if [ -z "${OPTION}" -o "${OPTION}" == '""' ]; then
							DELETE_KERNEL_BOOT_PARAMETERS=true
						else
							ADD_KERNEL_BOOT_PARAMETER=true
							KERNEL_BOOT_PARAMETER="${KERNEL_BOOT_PARAMETER} ${OPTION}"
						fi
						;;
					*)
						DISPLAY_MESSAGE "Unknown option '${FLAG}'."
						DIRTY_EXIT
						;;
				esac
				FLAG_FOUND=false
			fi
		fi
	done
	if ! ${ARGUMENT_FOUND}; then
		if [ -z "${LONG_FLAG}" ]; then
			GET_LONG_FLAG
		fi
		if [ "${LONG_FLAG}" == "--key" ]; then
			DISPLAY_MESSAGE "An argument must be specified when using '${LONG_FLAG}'."
		else
			DISPLAY_MESSAGE "An argument must be specified when using '${FLAG}' or '${LONG_FLAG}'."
		fi
		DIRTY_EXIT
	fi
	if [ -z "${ISO}" ]; then
		DISPLAY_MESSAGE "An ISO must be specified using '-i' or '--iso' option."
		DIRTY_EXIT
	fi
	if ! ${W_OPTION} && [ -f isorespin -o -d isorespin ] ; then
		DISPLAY_MESSAGE "Work directory 'isorespin' already exists."
		DIRTY_EXIT
	fi
}

function PROCESS_CMDLINE {
	sudo rm -rf ${WIP}
	sudo mkdir ${WIP} > /dev/null 2>&1
	if [ -z "${WORK_DIRECTORY}" ]; then
		echo "Work directory '$(basename ${WIP})' used ..." >> ${ISORESPIN_LOGFILE}
	else
		echo "Work directory '${WIP}' used ..." >> ${ISORESPIN_LOGFILE}
	fi
	CHECK_FOR_FREE_SPACE
	${O_OPTION} && PROCESS_O_OPTION
	${C_OPTION} && PROCESS_C_OPTION
	${S_OPTION} && PROCESS_S_OPTION
	${F_OPTION} && PROCESS_F_OPTION
	${D_OPTION} && PROCESS_D_OPTION
	${L_OPTION} && PROCESS_L_OPTION
	${R_OPTION} && PROCESS_R_OPTION
	${KEY_OPTION} && PROCESS_KEY_OPTION
	${E_OPTION} && PROCESS_E_OPTION
	${P_OPTION} && PROCESS_P_OPTION
	${B_OPTION} && PROCESS_B_OPTION
	${U_OPTION} && PROCESS_U_OPTION
	${K_OPTION} && PROCESS_K_OPTION
	if ${UPDATE_KERNEL}; then
		LINUXIUM_ISO="linuxium-${MAINLINE_BRANCH}-${BOOTLOADER}$(basename ${ISO})"
	else
		LINUXIUM_ISO="linuxium-${BOOTLOADER}$(basename ${ISO})"
	fi
	if ${ROLLING_KERNEL_OPTION}; then
		LINUXIUM_ISO="${LINUXIUM_ISO/linuxium/linuxium-${ROLLING}}"
	fi
	if ${ADD_PERSISTENCE}; then
		LINUXIUM_ISO="${LINUXIUM_ISO/linuxium/linuxium-persistence}"
		LINUXIUM_ISO="${LINUXIUM_ISO/rEFInd-/}"
	fi
	if [ "${TARGET_PROCESSOR}" == "atom" ]; then
		LINUXIUM_ISO="${LINUXIUM_ISO/linuxium/linuxium-atom}"
	fi
	if [ "${TARGET_PROCESSOR}" == "apollo" ]; then
		LINUXIUM_ISO="${LINUXIUM_ISO/linuxium/linuxium-apollo}"
	fi
	if ${SERVER_OPTION}; then
		LINUXIUM_ISO="${LINUXIUM_ISO/desktop/server}"
	fi
	if ! ${ROLLING_KERNEL_OPTION}; then
		if [ -z "${WORK_DIRECTORY}" -a -f ${LINUXIUM_ISO} ]; then
			DISPLAY_MESSAGE "Respun ISO '${LINUXIUM_ISO}' already exists."
			CLEAN_EXIT
		elif [ -f ${WORK_DIRECTORY}/${LINUXIUM_ISO} ]; then
			DISPLAY_MESSAGE "Respun ISO '${WORK_DIRECTORY}/${LINUXIUM_ISO}' already exists."
			CLEAN_EXIT
		fi
	fi
}

function CHECK_FOR_EXCLUSIVITY {
	if [ -f .isorespin.sh.lock ]; then
		echo "$(basename ${0}): Lock file exists ... wait for running instance of isorespin.sh to complete or remove '.isorespin.sh.lock' and restart."
		exit -1
	else
		sudo touch .isorespin.sh.lock
		export LC_ALL=C
		if [[ "${CWD}" =~ " " ]]; then
			echo "$(basename ${0}): Current directory '${CWD}' must not include a space in the name."
			UNCLEAN_EXIT
		fi
		if [ -d ${ISORESPIN_LOGFILE} ]; then
			echo "$(basename ${0}): Directory '$(basename ${ISORESPIN_LOGFILE})' already exists ... cannot create logfile."
			UNCLEAN_EXIT
		fi
		sudo rm -f ${ISORESPIN_LOGFILE}
		if ! $(touch ${ISORESPIN_LOGFILE} > /dev/null 2>&1); then
			echo "$(basename ${0}): Cannot create logfile '$(basename ${ISORESPIN_LOGFILE})'."
			UNCLEAN_EXIT
		fi
		ISORESPIN_TEMPLATE="${CWD}/isorespin.tpl"
		if [ -d ${ISORESPIN_TEMPLATE} ]; then
			echo "$(basename ${0}): Directory '$(basename ${ISORESPIN_TEMPLATE})' already exists ... cannot save template configuration file."
			UNCLEAN_EXIT
		fi
		if ! $(touch ${ISORESPIN_TEMPLATE} > /dev/null 2>&1); then
			echo "$(basename ${0}): Cannot save template configuration file '$(basename ${ISORESPIN_TEMPLATE})'."
			UNCLEAN_EXIT
		fi
	fi
}

function CHECK_PACKAGE_DEPENDENCIES {
	[ "$(uname -m)" != "x86_64" ] && echo "$(basename ${0}): This script can only be run on a 64-bit (amd64 or x86_64) OS." && exit
	[ ! $(sudo bash -c "command -v bc") ] && echo "$(basename ${0}): Please ensure package 'bc' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v losetup") ] && echo "$(basename ${0}): Please ensure package 'klibc-utils' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v ip") ] && echo "$(basename ${0}): Please ensure package 'iproute2' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v isoinfo") ] && echo "$(basename ${0}): Please ensure package 'genisoimage' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v mkdosfs") ] && echo "$(basename ${0}): Please ensure package 'dosfstools' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v mksquashfs") ] && echo "$(basename ${0}): Please ensure package 'squashfs-tools' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v rsync") ] && echo "$(basename ${0}): Please ensure package 'rsync' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v unsquashfs") ] && echo "$(basename ${0}): Please ensure package 'squashfs-tools' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v unzip") ] && echo "$(basename ${0}): Please ensure package 'unzip' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v wget") ] && echo "$(basename ${0}): Please ensure package 'wget' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v xargs") ] && echo "$(basename ${0}): Please ensure package 'findutils' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v xorriso") ] && echo "$(basename ${0}): Please ensure package 'xorriso' or equivalent for your distro is installed." && exit
	[ ! $(sudo bash -c "command -v script") ] && echo "$(basename ${0}): Please ensure package 'bsdutils' or equivalent for your distro is installed." && exit
	# backward compatibility
	# [ ! $(sudo bash -c "command -v 7z") ] && echo "$(basename ${0}): Please ensure package 'p7zip-full' or equivalent for your distro is installed." && exit
	# [ ! $(sudo bash -c "command -v lz4") ] && echo "$(basename ${0}): Please ensure package 'liblz4-tool' or equivalent for your distro is installed." && exit
	# [ ! $(sudo bash -c "command -v zstd") ] && echo "$(basename ${0}): Please ensure package 'zstd' or equivalent for your distro is installed." && exit
}

function CHECK_FOR_FREE_SPACE {
	FREE_SPACE=$(stat -f --format="%a*%S/1024/1024/1024" ${WIP} | bc -l)
	ROUNDED_FREE_SPACE=$(printf "%.0f\n" ${FREE_SPACE})
	DISPLAY_FREE_SPACE=$(printf "%.1f\n" ${FREE_SPACE})
	if [ "${ROUNDED_FREE_SPACE}" -lt 10 ]; then
		if [ -z "${WORK_DIRECTORY}" ]; then
			DISPLAY_MESSAGE "Insufficient disk space ... there is only ${DISPLAY_FREE_SPACE}GB free and not the required minimum of 10GB."
		else
			DISPLAY_MESSAGE "Insufficient disk space ... there is only ${DISPLAY_FREE_SPACE}GB free in '${WORK_DIRECTORY}' and not the required minimum of 10GB."
		fi
		CLEAN_EXIT
	fi
}

function CHECK_INTERNET_ACCESS {
	if ( ! ping -q -w 1 -c 1 ubuntu.com > /dev/null 2>&1 ); then
		DISPLAY_MESSAGE "Access to the internet is required for downloading files."
		CLEAN_EXIT
	fi
}

function CHECK_FOR_KERNEL_DUPLICATION {
	if ${U_OPTION}; then
		if ${ROLLING_KERNEL_OPTION}; then
			DISPLAY_MESSAGE "Rolling kernel cannot be used with '-u' or '--update' option."
		else
			DISPLAY_MESSAGE "Kernel update to latest version already specified using '-u' or '--update' option."
		fi
		DIRTY_EXIT
	elif ${K_OPTION}; then
		DISPLAY_MESSAGE "Kernel already specified using '-k' or '--kernel' option."
		DIRTY_EXIT
	elif ${ROLLING_KERNEL_OPTION}; then
		DISPLAY_MESSAGE "Kernel already specified using '${ROLLING}' option."
		DIRTY_EXIT
	fi
}

function GET_MAINLINE_INDEX {
	if [ ! -f ${WIP}/mainline_index.html ]; then
		sudo wget --timeout=10 "${MAINLINE_URL}/?C=N;O=D" -qO ${WIP}/mainline_index.html
		if [ ! -f ${WIP}/mainline_index.html ]; then
			DISPLAY_MESSAGE "Cannot get list of available mainline kernels ... check your internet connection and try again."
			CLEAN_EXIT
		fi
	fi
}

