function PROCESS_U_OPTION {
	GET_MAINLINE_INDEX
	MAINLINE_BRANCH=$(sed -n '/alt=\"\[DIR\]\"/s/^.*href="\([^/]*\).*/\1/p' ${WIP}/mainline_index.html | head -1)
	sudo rm -f ${WIP}/mainline_index.html
	UPDATE_KERNEL=true
}

function OPTION_KERNEL {
	CHECK_FOR_KERNEL_DUPLICATION
	if [ -z "${MAINLINE_BRANCH}" ]; then
		DISPLAY_MESSAGE "A kernel must be specified when using '-k' or '--kernel' option."
		DIRTY_EXIT
	fi
	K_OPTION=true
}

function PROCESS_K_OPTION {
	GET_MAINLINE_INDEX
	if ! $(echo $(sed -n '/alt=\"\[DIR\]\"/s/^.*href="\([^/]*\).*/\1/p' ${WIP}/mainline_index.html) | egrep -q "^${MAINLINE_BRANCH} | ${MAINLINE_BRANCH} | ${MAINLINE_BRANCH}$"); then
		DISPLAY_MESSAGE "Kernel '${MAINLINE_BRANCH}' not found in '${MAINLINE_URL}'."
		CLEAN_EXIT
	else
		sudo rm -f ${WIP}/mainline_index.html
	fi
	if ${K_OPTION}; then
		if [ "${MAINLINE_BRANCH:0:1}" == 'd' -o "${MAINLINE_BRANCH:0:1}" == 'l' ]; then
			CURRENT="/current"
		elif [ "${MAINLINE_BRANCH:0:1}" == 'v' ]; then
			CURRENT=""
		elif [ "${MAINLINE_BRANCH}" == "native" ]; then
			DISPLAY_MESSAGE "Kernel '${MAINLINE_BRANCH}' is not supported."
			CLEAN_EXIT
		fi
	fi
	UPDATE_KERNEL=true
}

function PROCESS_KEY_OPTION {
	ADD_KEY=true
}

function PROCESS_R_OPTION {
	ADD_REPOSITORY=true
}

function PROCESS_E_OPTION {
	PURGE_PACKAGE=true
}

function PROCESS_P_OPTION {
	ADD_PACKAGE=true
}

function PROCESS_L_OPTION {
	for LOCAL_PACKAGE_ARRAY in $(seq 0 $((${#LOCAL_PACKAGES[@]}-1)))
	do
		FULLNAME_LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]=""
		BASENAME_LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]=""
		for PACKAGE in ${LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]}
		do
			if [ ! -f ${PACKAGE} ]; then
				DISPLAY_MESSAGE "Local package '${PACKAGE}' not found."
				CLEAN_EXIT
			fi
			if [ "${PACKAGE##*.}" != "deb" ] && [ "$(file ${PACKAGE} | sed 's/.*: //' | sed 's/package.*/package/')" != "Debian binary package" ]; then
				DISPLAY_MESSAGE "Local package '${PACKAGE}' is not a Debian binary package."
				CLEAN_EXIT
			fi
			FULLNAME_LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]+=" $(readlink -f ${PACKAGE})"
			BASENAME_LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]+=" $(basename $(readlink -f ${PACKAGE}))"
		done
		FULLNAME_LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]="${FULLNAME_LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]:1}"
		BASENAME_LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]="${BASENAME_LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]:1}"
		((LOCAL_PACKAGE_ARRAY++))
	done
	ADD_LOCAL_PACKAGE=true
}

function PROCESS_D_OPTION {
	ADD_DOWNLOAD=true
}

function PROCESS_F_OPTION {
	for FILE_ARRAY in $(seq 0 $((${#FILES[@]}-1)))
	do
		FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]=""
		for ADDITIONAL_FILE in ${FILES[${FILE_ARRAY}]}
		do
			if [ ! -e ${ADDITIONAL_FILE} ]; then
				DISPLAY_MESSAGE "File '${ADDITIONAL_FILE}' not found."
				CLEAN_EXIT
			elif [ ! -f ${ADDITIONAL_FILE} -a ! -d ${ADDITIONAL_FILE} ]; then
				DISPLAY_MESSAGE "File '${ADDITIONAL_FILE}' incorrect file type."
				CLEAN_EXIT
			fi
			FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]+=" $(readlink -f ${ADDITIONAL_FILE}) "
		done
		FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]="${FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]:1}"
		((FILE_ARRAY++))
	done
	ADD_FILE=true
}

function OPTION_BOOT {
	BOOT=${BOOT,,}
	if ${TARGET_PROCESSOR_OPTION}; then
		if [ "${BOOT}" == "grub" -o "${BOOT}" == "grub-32" -o "${BOOT}" == "grub-64" ] && [ "${TARGET_PROCESSOR}" == "apollo" ]; then
			DISPLAY_MESSAGE "Boot option of 'GRUB', 'GRUB-32' or 'GRUB-64' cannot be specified together with '--apollo'."
			DIRTY_EXIT
		fi
		if [ "${BOOT}" == "refind" -a "${TARGET_PROCESSOR}" == "apollo" ]; then
			DISPLAY_MESSAGE "Boot option of 'rEFInd' cannot be specified together with '--apollo'."
			DIRTY_EXIT
		fi
		if [ "${BOOT}" == "linuxium" -a "${TARGET_PROCESSOR}" == "apollo" ]; then
			DISPLAY_MESSAGE "Boot option of 'Linuxium' cannot be specified together with '--apollo'."
			DIRTY_EXIT
		fi
	fi
	if ${S_OPTION} && [ "${BOOT}" != "refind" ]; then
		DISPLAY_MESSAGE "Boot option should not be used together with persistence."
		DIRTY_EXIT
	fi
	if ${B_OPTION}; then
		DISPLAY_MESSAGE "Boot option already specified using '-b' or '--boot'."
		DIRTY_EXIT
	fi
	if [ "${BOOT}" != "grub" -a "${BOOT}" != "grub-32" -a "${BOOT}" != "grub-64" -a "${BOOT}" != "refind" -a "${BOOT}" != "linuxium" ]; then
		DISPLAY_MESSAGE "Either 'GRUB', 'GRUB-32', 'GRUB-64', 'rEFInd' or 'Linuxium' must be specified when using '-b' or '--boot' option."
		DIRTY_EXIT
	fi
	if [ "${BOOT}" == "linuxium" ] && (! sudo dpkg -S systemd 2> /dev/null | grep -sq linuxx64.efi.stub); then
		DISPLAY_MESSAGE "Your distro must support 'systemd' in order to use the '-b Linuxium' option."
		DIRTY_EXIT
	fi
	if [ "${BOOT}" == "linuxium" ]; then
		PACKAGES[${PACKAGE_ARRAY}]="binutils"
		((PACKAGE_ARRAY++))
		ADD_PACKAGE=true
	fi
	B_OPTION=true
}

function PROCESS_B_OPTION {
	if [ "${BOOT}" == "refind" ]; then
		BOOTLOADER="rEFInd-"
		USE_GRUB_BOOTLOADER=false
		USE_REFIND_BOOTMANAGER=true
	elif [ "${BOOT}" == "linuxium" ]; then
		BOOTLOADER="bootscript-"
		USE_GRUB_BOOTLOADER=false
		USE_LINUXIUM_BOOTSCRIPT=true
	# else
		# BOOTLOADER="grub-"
	fi
}

function OPTION_STORAGE {
	if ${B_OPTION} && [ "${BOOT}" != "refind" ]; then
		DISPLAY_MESSAGE "Persistence should not be used together with boot option."
		DIRTY_EXIT
	fi
	if [ "${TARGET_PROCESSOR}" == "apollo" ]; then
		DISPLAY_MESSAGE "Persistence cannot be specified together with '--apollo'."
		DIRTY_EXIT
	fi
	if ${S_OPTION}; then
		DISPLAY_MESSAGE "Persistence already specified using '-s' or '--storage' option."
		DIRTY_EXIT
	fi
	if [ -z "${STORAGE}" ] || [ "${STORAGE:0:1}" == '-' ]; then
		DISPLAY_MESSAGE "A size must be specified when using '-s' or '--storage' option."
		DIRTY_EXIT
	fi
	PERSISTENCE_UNIT=${STORAGE//[[:digit:]]/}
	PERSISTENCE_SIZE=${STORAGE//${PERSISTENCE_UNIT}/}
	if [ -z "${PERSISTENCE_SIZE}" ]; then
		DISPLAY_MESSAGE "A size must be specified when using '-s' or '--storage' option."
		DIRTY_EXIT
	fi
	if ! [[ "${PERSISTENCE_SIZE}" =~ ^-?[0-9]+$ ]]; then
		DISPLAY_MESSAGE "A size must be specified when using '-s' or '--storage' option."
		DIRTY_EXIT
	fi
	SECTOR_SIZE=512
	case "${PERSISTENCE_UNIT}" in
		"MB")
			PERSISTENCE_UNIT="M"
			PERSISTENCE_SECTOR_SIZE=$((${PERSISTENCE_SIZE}*1024*1024/${SECTOR_SIZE}))
			;;
		"GB")
			PERSISTENCE_UNIT="G"
			PERSISTENCE_SECTOR_SIZE=$((${PERSISTENCE_SIZE}*1024*1024*1024/${SECTOR_SIZE}))
			;;
		*)
			DISPLAY_MESSAGE "Unit for persistence size not 'MB' or 'GB'."
			DIRTY_EXIT
			;;
	esac
	if [ "${PERSISTENCE_UNIT}" == "M" -a "${PERSISTENCE_SIZE}" -le 99 ]; then
		DISPLAY_MESSAGE "A minimum size of 100MB is required for persistence."
		DIRTY_EXIT
	fi
	S_OPTION=true
	BOOT="refind"
}

function PROCESS_S_OPTION {
	PERSISTENCE="persistent"
	BOOTLOADER="rEFInd-"
	USE_REFIND_BOOTMANAGER=true
	ADD_PERSISTENCE=true;
}

function PROCESS_C_OPTION {
	ADD_COMMAND=true
}

function PROCESS_O_OPTION {
	EXTRACT_FILE=true
}

function OPTION_ROLLING_LIST {
	if [ "${NUMBER_OF_ARGUMENTS}" != 1 ]; then
		DISPLAY_MESSAGE "Invalid invocation."
		USAGE
		rm -f ${ISORESPIN_LOGFILE}
		DIRTY_EXIT
	fi
	CHECK_FOR_KERNEL_DUPLICATION
	sudo rm -rf ${WIP}
	sudo mkdir ${WIP} > /dev/null 2>&1
	sudo wget --timeout=10 https://launchpad.net/ubuntu/+series -qO ${WIP}/Series.html
	if [ ! -f ${WIP}/Series.html ]; then
		DISPLAY_MESSAGE "Cannot fetch active series list ... check your internet connection and try again."
		CLEAN_EXIT
	fi
	SERIES_ARRAY=0
	for SERIES in $(grep '<strong><a href="/ubuntu/' ${WIP}/Series.html | sed 's?.*/ubuntu/??' | sed 's/".*(/_/' | sed 's/).*//')
	do
		RELEASE_SERIES[SERIES_ARRAY]=${SERIES%_*}
		RELEASE_NUMBER[SERIES_ARRAY]=${SERIES#*_}
		((SERIES_ARRAY++))
	done
	sudo rm -f ${WIP}/Series.html
	sudo wget --timeout=10 "https://packages.ubuntu.com/" -qO ${WIP}/Releases.html
	if [ ! -f ${WIP}/Releases.html ]; then
		DISPLAY_MESSAGE "Cannot fetch distro information ... check your internet connection and try again."
		CLEAN_EXIT
	fi
	RELEASES=$(grep '<li><a href=' ${WIP}/Releases.html | grep -v '-' | sed 's/.*">//' | sed 's/<.*//')
	sudo rm -f ${WIP}/Releases.html
	for RELEASE in ${RELEASES}
	do
		# RELEASE
		for SERIES_ARRAY in $(seq 0 $((${#RELEASE_SERIES[@]}-1)))
		do
			if [ "${RELEASE_SERIES[${SERIES_ARRAY}]}" == "${RELEASE}" ]; then
				break
			fi
		done
		if GET_RELEASE_EOL ${RELEASE_NUMBER[${SERIES_ARRAY}]}; then
			if [[ $((($(date -d "${DISTRO_EOL}" +%s)-$(date +%s))/60/60/24)) -lt 0 ]]; then
				# RELEASE is EOL so skip it
				continue
			fi
		else
			# cannot determine EOL for RELEASE so skip it
			continue
		fi
		echo "Release '${RELEASE}':"
		ROLLING_RELEASE_URL="http://archive.ubuntu.com/ubuntu/dists/${RELEASE}/main/binary-amd64/Packages.gz"
		ROLLING_UPDATES_URL="http://archive.ubuntu.com/ubuntu/dists/${RELEASE}-updates/main/binary-amd64/Packages.gz"
		ROLLING_SECURITY_URL="http://archive.ubuntu.com/ubuntu/dists/${RELEASE}-security/main/binary-amd64/Packages.gz"
		for ROLLING_PACKAGE in linux-${KERNEL_TYPE} linux-${KERNEL_TYPE}-hwe-${RELEASE_NUMBER[${SERIES_ARRAY}]} linux-${KERNEL_TYPE}-hwe-${RELEASE_NUMBER[${SERIES_ARRAY}]}-edge
		do
			ROLLING_KERNEL_VERSION=0.0.0-0
			for ROLLING_PACKAGES_URL in ${ROLLING_RELEASE_URL} ${ROLLING_UPDATES_URL} ${ROLLING_SECURITY_URL}
			do
				GET_LATEST_ROLLING_KERNEL_VERSION
			done
			if [ "${ROLLING_KERNEL_VERSION}" == "0.0.0-0" ]; then
				echo "rolling-release"${ROLLING_PACKAGE} | sed "s/linux-${KERNEL_TYPE}//" | sed "s/^-//" | sed "s/-${RELEASE_NUMBER[${SERIES_ARRAY}]}//" | sed "s/-$//" | sed "s/$/: Not available/"
			else
				echo "rolling-release"${ROLLING_PACKAGE} | sed "s/linux-${KERNEL_TYPE}//" | sed "s/^-//" | sed "s/-${RELEASE_NUMBER[${SERIES_ARRAY}]}//" | sed "s/-$//" | sed "s/$/: ${ROLLING_KERNEL_VERSION}/"
			fi
		done
		# PROPOSED
		sudo wget --timeout=10 "http://archive.ubuntu.com/ubuntu/dists/${RELEASE}-proposed/main/binary-amd64/Packages.gz" -qO ${WIP}/Packages.gz
		if [ ! -f ${WIP}/Packages.gz ]; then
			DISPLAY_MESSAGE "Cannot fetch package list ... check your internet connection and try again."
			CLEAN_EXIT
		fi
		for ROLLING_PACKAGE in linux-${KERNEL_TYPE} linux-${KERNEL_TYPE}-hwe-${RELEASE_NUMBER[${SERIES_ARRAY}]} linux-${KERNEL_TYPE}-hwe-${RELEASE_NUMBER[${SERIES_ARRAY}]}-edge
		do
			ROLLING_KERNEL_VERSION=$(zcat ${WIP}/Packages.gz | sed -n "/^Package:[ ]*${ROLLING_PACKAGE}$/,/^Filename:/ s/\.[0-9]*_amd64.deb//p" | sed 's/.*_//' | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\).\([0-9]*\).*/\1.\2.\3-\4/')
			if [ -n "${ROLLING_KERNEL_VERSION}" ]; then
				echo "rolling-proposed"${ROLLING_PACKAGE} | sed "s/linux-${KERNEL_TYPE}//" | sed "s/^-//" | sed "s/-${RELEASE_NUMBER[${SERIES_ARRAY}]}//" | sed "s/-$//" | sed "s/$/: ${ROLLING_KERNEL_VERSION}/"
			else
				echo "rolling-proposed"${ROLLING_PACKAGE} | sed "s/linux-${KERNEL_TYPE}//" | sed "s/^-//" | sed "s/-${RELEASE_NUMBER[${SERIES_ARRAY}]}//" | sed "s/-$//" | sed "s/$/: Not available/"
			fi
		done
		sudo rm -f ${WIP}/Packages.gz
		# TESTING
		sudo wget --timeout=10 "http://ppa.launchpad.net/canonical-kernel-team/ppa/ubuntu/dists/${RELEASE}/main/binary-amd64/Packages.gz" -qO ${WIP}/Packages.gz
		if [ ! -f ${WIP}/Packages.gz ]; then
			DISPLAY_MESSAGE "Cannot fetch package list ... check your internet connection and try again."
			CLEAN_EXIT
		fi
		for ROLLING_PACKAGE in linux-${KERNEL_TYPE} linux-${KERNEL_TYPE}-hwe-${RELEASE_NUMBER[${SERIES_ARRAY}]} linux-${KERNEL_TYPE}-hwe-${RELEASE_NUMBER[${SERIES_ARRAY}]}-edge
		do
			ROLLING_KERNEL_VERSION=$(zcat ${WIP}/Packages.gz | sed -n "/^Package:[ ]*${ROLLING_PACKAGE}$/,/^Filename:/ s/\.[0-9]*_amd64.deb//p" | sed 's/.*_//' | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\).\([0-9]*\).*/\1.\2.\3-\4/')
			if [ -n "${ROLLING_KERNEL_VERSION}" ]; then
				echo "rolling-testing"${ROLLING_PACKAGE} | sed "s/linux-${KERNEL_TYPE}//" | sed "s/^-//" | sed "s/-${RELEASE_NUMBER[${SERIES_ARRAY}]}//" | sed "s/-$//" | sed "s/$/: ${ROLLING_KERNEL_VERSION}/"
			else
				echo "rolling-testing"${ROLLING_PACKAGE} | sed "s/linux-${KERNEL_TYPE}//" | sed "s/^-//" | sed "s/-${RELEASE_NUMBER[${SERIES_ARRAY}]}//" | sed "s/-$//" | sed "s/$/: Not available/"
			fi
		done
		sudo rm -f ${WIP}/Packages.gz
		# UNSTABLE
		sudo wget --timeout=10 "https://launchpad.net/~canonical-kernel-team/+archive/ubuntu/unstable/+packages" -qO ${WIP}/Packages.html
		if [ ! -f ${WIP}/Packages.html ]; then
			DISPLAY_MESSAGE "Cannot fetch kernel distros ... check your internet connection and try again."
			CLEAN_EXIT
		fi
		if ! $(sed -n '/currently publishes packages for/{n;s/and //;s/[[:punct:]]//gp}' ${WIP}/Packages.html | grep -qi ${RELEASE}); then
			echo "rolling-unstable: Not available"
			echo "rolling-unstable-hwe: Not available"
			echo "rolling-unstable-hwe-edge: Not available"
		else
			sudo rm -f ${WIP}/Packages.html
			sudo wget --timeout=10 "http://ppa.launchpad.net/canonical-kernel-team/unstable/ubuntu/dists/${RELEASE}/main/binary-amd64/Packages.gz" -qO ${WIP}/Packages.gz
			if [ ! -f ${WIP}/Packages.gz ]; then
				DISPLAY_MESSAGE "Cannot fetch package list ... check your internet connection and try again."
				CLEAN_EXIT
			fi
			for ROLLING_PACKAGE in linux-${KERNEL_TYPE} linux-${KERNEL_TYPE}-hwe-${RELEASE_NUMBER[${SERIES_ARRAY}]} linux-${KERNEL_TYPE}-hwe-${RELEASE_NUMBER[${SERIES_ARRAY}]}-edge
			do
				ROLLING_KERNEL_VERSION=$(zcat ${WIP}/Packages.gz | sed -n "/^Package:[ ]*${ROLLING_PACKAGE}$/,/^Filename:/ s/\.[0-9]*_amd64.deb//p" | sed 's/.*_//' | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\).\([0-9]*\).*/\1.\2.\3-\4/')
				if [ -n "${ROLLING_KERNEL_VERSION}" ]; then
					echo "rolling-unstable"${ROLLING_PACKAGE} | sed "s/linux-${KERNEL_TYPE}//" | sed "s/^-//" | sed "s/-${RELEASE_NUMBER[${SERIES_ARRAY}]}//" | sed "s/-$//" | sed "s/$/: ${ROLLING_KERNEL_VERSION}/"
				else
					echo "rolling-unstable"${ROLLING_PACKAGE} | sed "s/linux-${KERNEL_TYPE}//" | sed "s/^-//" | sed "s/-${RELEASE_NUMBER[${SERIES_ARRAY}]}//" | sed "s/-$//" | sed "s/$/: Not available/"
				fi
			done
			sudo rm -f ${WIP}/Packages.gz
		fi
	done
	rm -f ${ISORESPIN_LOGFILE}
	CLEAN_EXIT
}

function OPTION_ROLLING_KERNEL {
	CHECK_FOR_KERNEL_DUPLICATION
	ROLLING_KERNEL_OPTION=true
}

function PROCESS_ROLLING_KERNEL_OPTION {
	ROLLING_KERNEL=${ROLLING#rolling-}
	case "${ROLLING_KERNEL}" in
		"release")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}"
			ROLLING_KERNEL_VERSION=0.0.0-0
			ROLLING_RELEASE_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}/main/binary-amd64/Packages.gz"
			ROLLING_UPDATES_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}-updates/main/binary-amd64/Packages.gz"
			ROLLING_SECURITY_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}-security/main/binary-amd64/Packages.gz"
			for ROLLING_PACKAGES_URL in ${ROLLING_RELEASE_URL} ${ROLLING_UPDATES_URL} ${ROLLING_SECURITY_URL}
			do
				GET_LATEST_ROLLING_KERNEL_VERSION
			done
			if [ "${ROLLING_KERNEL_VERSION}" == "0.0.0-0" ]; then
				DISPLAY_MESSAGE "Rolling '${ROLLING_KERNEL}' kernel is not available for ISO distribution release of '${DISTRO_CODENAME}'."
				MESSY_EXIT
			else
				LINUXIUM_ISO="${LINUXIUM_ISO/${ROLLING}/v${ROLLING_KERNEL_VERSION}}"
				PACKAGES[${PACKAGE_ARRAY}]="${ROLLING_PACKAGE}"
				((PACKAGE_ARRAY++))
				ADD_PACKAGE=true
			fi
			;;
		"release-hwe")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}-hwe-${DISTRO_RELEASE}"
			ROLLING_KERNEL_VERSION=0.0.0-0
			ROLLING_RELEASE_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}/main/binary-amd64/Packages.gz"
			ROLLING_UPDATES_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}-updates/main/binary-amd64/Packages.gz"
			ROLLING_SECURITY_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}-security/main/binary-amd64/Packages.gz"
			for ROLLING_PACKAGES_URL in ${ROLLING_RELEASE_URL} ${ROLLING_UPDATES_URL} ${ROLLING_SECURITY_URL}
			do
				GET_LATEST_ROLLING_KERNEL_VERSION
			done
			if [ "${ROLLING_KERNEL_VERSION}" == "0.0.0-0" ]; then
				DISPLAY_MESSAGE "Rolling '${ROLLING_KERNEL}' kernel is not available for ISO distribution release of '${DISTRO_CODENAME}'."
				MESSY_EXIT
			else
				LINUXIUM_ISO="${LINUXIUM_ISO/${ROLLING}/v${ROLLING_KERNEL_VERSION}}"
				PACKAGES[${PACKAGE_ARRAY}]="${ROLLING_PACKAGE}"
				((PACKAGE_ARRAY++))
				ADD_PACKAGE=true
			fi
			;;
		"release-hwe-edge")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}-hwe-${DISTRO_RELEASE}-edge"
			ROLLING_KERNEL_VERSION=0.0.0-0
			ROLLING_RELEASE_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}/main/binary-amd64/Packages.gz"
			ROLLING_UPDATES_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}-updates/main/binary-amd64/Packages.gz"
			ROLLING_SECURITY_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}-security/main/binary-amd64/Packages.gz"
			for ROLLING_PACKAGES_URL in ${ROLLING_RELEASE_URL} ${ROLLING_UPDATES_URL} ${ROLLING_SECURITY_URL}
			do
				GET_LATEST_ROLLING_KERNEL_VERSION
			done
			if [ "${ROLLING_KERNEL_VERSION}" == "0.0.0-0" ]; then
				DISPLAY_MESSAGE "Rolling '${ROLLING_KERNEL}' kernel is not available for ISO distribution release of '${DISTRO_CODENAME}'."
				MESSY_EXIT
			else
				LINUXIUM_ISO="${LINUXIUM_ISO/${ROLLING}/v${ROLLING_KERNEL_VERSION}}"
				PACKAGES[${PACKAGE_ARRAY}]="${ROLLING_PACKAGE}"
				((PACKAGE_ARRAY++))
				ADD_PACKAGE=true
			fi
			;;
		"proposed")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}"
			ROLLING_REPOSITORY="deb http://archive.ubuntu.com/ubuntu/ ${DISTRO_CODENAME}-proposed main restricted"
			ROLLING_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}-proposed/main/binary-amd64/Packages.gz"
			ADD_ROLLING_KERNEL
			;;
		"proposed-hwe")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}-hwe-${DISTRO_RELEASE}"
			ROLLING_REPOSITORY="deb http://archive.ubuntu.com/ubuntu/ ${DISTRO_CODENAME}-proposed main restricted"
			ROLLING_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}-proposed/main/binary-amd64/Packages.gz"
			ADD_ROLLING_KERNEL
			;;
		"proposed-hwe-edge")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}-hwe-${DISTRO_RELEASE}-edge"
			ROLLING_REPOSITORY="deb http://archive.ubuntu.com/ubuntu/ ${DISTRO_CODENAME}-proposed main restricted"
			ROLLING_URL="http://archive.ubuntu.com/ubuntu/dists/${DISTRO_CODENAME}-proposed/main/binary-amd64/Packages.gz"
			ADD_ROLLING_KERNEL
			;;
		"testing")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}"
			ROLLING_REPOSITORY="ppa:canonical-kernel-team/ppa"
			ROLLING_URL="http://ppa.launchpad.net/canonical-kernel-team/ppa/ubuntu/dists/${DISTRO_CODENAME}/main/binary-amd64/Packages.gz"
			ADD_ROLLING_KERNEL
			;;
		"testing-hwe")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}-hwe-${DISTRO_RELEASE}"
			ROLLING_REPOSITORY="ppa:canonical-kernel-team/ppa"
			ROLLING_URL="http://ppa.launchpad.net/canonical-kernel-team/ppa/ubuntu/dists/${DISTRO_CODENAME}/main/binary-amd64/Packages.gz"
			ADD_ROLLING_KERNEL
			;;
		"testing-hwe-edge")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}-hwe-${DISTRO_RELEASE}-edge"
			ROLLING_REPOSITORY="ppa:canonical-kernel-team/ppa"
			ROLLING_URL="http://ppa.launchpad.net/canonical-kernel-team/ppa/ubuntu/dists/${DISTRO_CODENAME}/main/binary-amd64/Packages.gz"
			ADD_ROLLING_KERNEL
			;;
		"unstable")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}"
			ROLLING_REPOSITORY="ppa:canonical-kernel-team/unstable"
			ROLLING_URL="http://ppa.launchpad.net/canonical-kernel-team/unstable/ubuntu/dists/${DISTRO_CODENAME}/main/binary-amd64/Packages.gz"
			CHECK_ROLLING_KERNEL
			ADD_ROLLING_KERNEL
			;;
		"unstable-hwe")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}-hwe-${DISTRO_RELEASE}"
			ROLLING_REPOSITORY="ppa:canonical-kernel-team/unstable"
			ROLLING_URL="http://ppa.launchpad.net/canonical-kernel-team/unstable/ubuntu/dists/${DISTRO_CODENAME}/main/binary-amd64/Packages.gz"
			CHECK_ROLLING_KERNEL
			ADD_ROLLING_KERNEL
			;;
		"unstable-hwe-edge")
			ROLLING_PACKAGE="linux-${KERNEL_TYPE}-hwe-${DISTRO_RELEASE}-edge"
			ROLLING_REPOSITORY="ppa:canonical-kernel-team/unstable"
			ROLLING_URL="http://ppa.launchpad.net/canonical-kernel-team/unstable/ubuntu/dists/${DISTRO_CODENAME}/main/binary-amd64/Packages.gz"
			CHECK_ROLLING_KERNEL
			ADD_ROLLING_KERNEL
			;;
	esac
	if [ -z "${WORK_DIRECTORY}" -a -f ${CWD}/${LINUXIUM_ISO} ]; then
		DISPLAY_MESSAGE "Respun ISO '${LINUXIUM_ISO}' already exists."
		MESSY_EXIT
	elif [ -f ${WORK_DIRECTORY}/${LINUXIUM_ISO} ]; then
		DISPLAY_MESSAGE "Respun ISO '${WORK_DIRECTORY}/${LINUXIUM_ISO}' already exists."
		MESSY_EXIT
	fi
}

function OPTION_SERVER {
	if [ "${ISO_DISTRO}" != "Ubuntu" ]; then
		DISPLAY_MESSAGE "Only the Ubuntu desktop ISO can be respun with the '--server' option at the moment."
		DIRTY_EXIT
	fi
	if ${SERVER_OPTION}; then
		DISPLAY_MESSAGE "Server option already specified."
		DIRTY_EXIT
	fi
	SERVER_OPTION=true
}

function SERVER_PREPROCESSING {
	cd ${WIP}
	if [ "${DISTRO_RELEASE}" == "20.04" ]; then
		sudo touch iso-chroot/var/lib/whoopsie/whoopsie-id
	fi
}

function PROCESS_SERVER_OPTION {
	if [ "${DISTRO_RELEASE}" != "20.04" -a "${DISTRO_RELEASE}" != "18.04" ]; then
		DISPLAY_MESSAGE "Only Ubuntu 18.04 and 20.04 ISOs are supported with the '--server' option at the moment."
		MESSY_EXIT
	fi
	if [ -z "${DISTRO_POINT_RELEASE}" ]; then
		DISPLAY_MESSAGE "Cannot determing point release of ISO."
		MESSY_EXIT
	fi
	CASPER_KERNEL_STRING=$(file iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_VMLINUZ})
	CASPER_KERNEL_BUILD=${CASPER_KERNEL_STRING#* #}
	CASPER_KERNEL_BUILD=${CASPER_KERNEL_BUILD%-Ubuntu *}
	CASPER_KERNEL_VERSION=${CASPER_KERNEL_STRING#*version }
	CASPER_KERNEL_VERSION=${CASPER_KERNEL_VERSION%-generic *}
	# starting with 20.04
	# and this is why only 18.04 and 20.04 are supported
	if [ "${DISTRO_RELEASE}" == "20.04" ]; then
		LINUX_PACKAGE="linux-generic-hwe-${DISTRO_RELEASE}"
		SERVER_PURGE_PACKAGES="ubuntu-desktop^"
		# this still leaves a small number of residual packages which can be fine-tuned further if required (currently tuned for 20.04)
		DESKTOP_REMNANT_PACKAGES="apt-clone libdebian-installer4 libtimezonemap-data ubiquity-slideshow-ubuntu ubiquity-ubuntu-artwork \
			firefox-locale-de firefox-locale-en firefox-locale-es firefox-locale-fr firefox-locale-it firefox-locale-pt firefox-locale-ru firefox-locale-zh-hans \
			language-pack-gnome-de language-pack-gnome-en language-pack-gnome-es language-pack-gnome-fr language-pack-gnome-it language-pack-gnome-pt \
			language-pack-gnome-ru language-pack-gnome-zh-hans mythes-de mythes-de-ch rdate \
			libchewing3-data libhangul-data libpinyin-data m17n-db mozc-data tegaki-zinnia-japanese \
			gparted-common"
		APT_PURGE_OPTION="--autoremove --allow-remove-essential"
		# similarly this also omits a small number of packages and can be fine-tuned further if required
		SERVER_ADD_PACKAGES="fdisk ubuntu-server plymouth-theme-spinner casper gdisk network-manager ${LINUX_PACKAGE}"
	elif [ "${DISTRO_RELEASE}" == "18.04" ]; then
		if [[ ${CASPER_KERNEL_BUILD} =~ "~" ]]; then
			LINUX_PACKAGE="linux-generic-hwe-${DISTRO_RELEASE}"
		else
			LINUX_PACKAGE="linux-generic"
		fi
		SERVER_PURGE_PACKAGES="ubuntu-desktop^"
		# this still leaves a small number of residual packages which can be fine-tuned further if required (currently tuned for 18.04.4)
		DESKTOP_REMNANT_PACKAGES="apt-clone libdebian-installer4 libtimezonemap-data ubiquity-slideshow-ubuntu ubiquity-ubuntu-artwork \
			firefox-locale-de firefox-locale-en firefox-locale-es firefox-locale-fr firefox-locale-it firefox-locale-pt firefox-locale-ru firefox-locale-zh-hans \
			language-pack-gnome-de language-pack-gnome-en language-pack-gnome-es language-pack-gnome-fr language-pack-gnome-it language-pack-gnome-pt \
			language-pack-gnome-ru language-pack-gnome-zh-hans mythes-de mythes-de-ch rdate \
			libchewing3-data libhangul-data libpinyin-data m17n-db mozc-data tegaki-zinnia-japanese \
			linux-headers-${CASPER_KERNEL_VERSION} linux-headers-${CASPER_KERNEL_VERSION}-generic \
			linux-image-${CASPER_KERNEL_VERSION}-generic linux-modules-${CASPER_KERNEL_VERSION}-generic"
		APT_PURGE_OPTION="--autoremove"
		# similarly this also omits a small number of packages and can be fine-tuned further if required
		SERVER_ADD_PACKAGES="ubuntu-server casper gdisk network-manager ${LINUX_PACKAGE}"
	fi
	for SERVER_PURGE_PACKAGE in ${SERVER_PURGE_PACKAGES}
	do
		PURGE_PACKAGE_FOUND=false
		if ${PURGE_PACKAGE}; then
			for PACKAGE_ARRAY in $(seq 0 $((${#PURGE_PACKAGES[@]}-1)))
			do
				for PACKAGE in ${PURGE_PACKAGES[${PACKAGE_ARRAY}]}
				do
					if [ "${PACKAGE}" == "${SERVER_PURGE_PACKAGE}" ]; then
						PURGE_PACKAGE_FOUND=true
						break 2
					fi
				done
			done
		fi
		if ! ${PURGE_PACKAGE_FOUND}; then
			PACKAGE_ARRAY=${#PURGE_PACKAGES[@]}
			PURGE_PACKAGES[${PACKAGE_ARRAY}]+="${SERVER_PURGE_PACKAGE}"
			((PURGE_ARRAY++))
			PURGE_PACKAGE=true
		fi
	done
	# remnants are added en masse to prevent the processing overhead of having to individually purge multiple packages so consequently duplication checks are skipped
	PACKAGE_ARRAY=${#PURGE_PACKAGES[@]}
	PURGE_PACKAGES[${PACKAGE_ARRAY}]+="${DESKTOP_REMNANT_PACKAGES}"
	((PURGE_ARRAY++))
	PURGE_PACKAGE=true
	for SERVER_ADD_PACKAGE in ${SERVER_ADD_PACKAGES}
	do
		ADD_PACKAGE_FOUND=false
		if ${ADD_PACKAGE}; then
			for PACKAGE_ARRAY in $(seq 0 $((${#PACKAGES[@]}-1)))
			do
				for PACKAGE in ${PACKAGES[${PACKAGE_ARRAY}]}
				do
					if [ "${PACKAGE}" == "${SERVER_ADD_PACKAGE}" ]; then
						ADD_PACKAGE_FOUND=true
						break 2
					fi
				done
			done
		fi
		if ! ${ADD_PACKAGE_FOUND}; then
			PACKAGE_ARRAY=${#PACKAGES[@]}
			PACKAGES[${PACKAGE_ARRAY}]+="${SERVER_ADD_PACKAGE}"
			((PACKAGE_ARRAY++))
			ADD_PACKAGE=true
		fi
	done
	for SERVER_ADDITIONAL_FILE in linservin.sh
	do
		ADDITIONAL_FILE_FOUND=false
		if ${ADD_FILE}; then
			for FILE_ARRAY in $(seq 0 $((${#FULLNAME_ADDITIONAL_FILES[@]}-1)))
			do
				for ADDITIONAL_FILE in ${FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]}
				do
					if [ "$(basename ${ADDITIONAL_FILE})" == "${SERVER_ADDITIONAL_FILE}" ]; then
						ADDITIONAL_FILE_FOUND=true
						break 2
					fi
				done
			done
		fi
		if ! ${ADDITIONAL_FILE_FOUND}; then
			case ${SERVER_ADDITIONAL_FILE} in
				"linservin.sh")
					DOWNLOAD_FILE http://url.linuxium.com.au/linservin_sh ${SERVER_ADDITIONAL_FILE}
					;;
			esac
			if [ ! -f ${SERVER_ADDITIONAL_FILE} ]; then
				DISPLAY_MESSAGE "Cannot fetch '${SERVER_ADDITIONAL_FILE}' ... check your internet connection and try again."
				MESSY_EXIT
			fi
			sudo chmod +x ${SERVER_ADDITIONAL_FILE}
			FILE_ARRAY=${#FULLNAME_ADDITIONAL_FILES[@]}
			FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]="$(readlink -f ${SERVER_ADDITIONAL_FILE}) "
			((FILE_ARRAY++))
			ADD_FILE=true
		fi
	done
	for SERVER_COMMAND in "useradd -c ubuntu -d /home/ubuntu -m -g users -s /bin/bash ubuntu" "sed -i '/^root/ a ubuntu ALL=(ALL:ALL) ALL' /etc/sudoers" "passwd -d ubuntu"
	do
		COMMAND_FOUND=false
		if ${ADD_COMMAND}; then
			for COMMAND_ARRAY in $(seq 0 $((${#COMMANDS[@]}-1)))
			do
				for COMMAND in "${COMMANDS[${COMMAND_ARRAY}]}"
				do
					if [ "${COMMAND}" == "${SERVER_COMMAND}" ]; then
						COMMAND_FOUND=true
						break 2
					fi
				done
			done
		fi
		if ! ${COMMAND_FOUND}; then
			COMMAND_ARRAY=${#COMMANDS[@]}
			COMMANDS[${COMMAND_ARRAY}]="${SERVER_COMMAND}"
			((COMMAND_ARRAY++))
			ADD_COMMAND=true
		fi
	done
}

function SERVER_POSTPROCESSING {
	cd ${WIP}
	if [ "${DISTRO_RELEASE}" == "20.04" ]; then
		# in 20.04 if 'splash' is included in an installed '/etc/default/grub' then the login doesn't initially show on 'tty1' so remove it
		sudo sed -i 's/[[:space:]]*splash//' iso-chroot/etc/default/grub
		# and also remove it from '/boot/grub/grub.cfg'
		sudo sed -i 's/[[:space:]]*splash//' iso-directory-structure/boot/grub/grub.cfg
	fi
}

function OPTION_TARGET_PROCESSOR {
	if [ "${TARGET_PROCESSOR}" != "atom" -a "${TARGET_PROCESSOR}" != "apollo" ]; then
		DISPLAY_MESSAGE "Only 'atom' or 'apollo' can be specified as a target processor."
		DIRTY_EXIT
	fi
	if ${TARGET_PROCESSOR_OPTION}; then
		DISPLAY_MESSAGE "Target processor already specified."
		DIRTY_EXIT
	fi
	if ${B_OPTION}; then
		if [ "${BOOT}" == "grub" -o "${BOOT}" == "grub-32" -o "${BOOT}" == "grub-64" ] && [ "${TARGET_PROCESSOR}" == "apollo" ]; then
			DISPLAY_MESSAGE "Boot option of 'GRUB', 'GRUB-32' or 'GRUB-64' cannot be specified together with '--apollo'."
			DIRTY_EXIT
		fi
	fi
	if ${B_OPTION}; then
		if [ "${BOOT}" == "refind" -a "${TARGET_PROCESSOR}" == "apollo" ]; then
			DISPLAY_MESSAGE "Boot option of 'rEFInd' cannot be specified together with '--apollo'."
			DIRTY_EXIT
		fi
	fi
	if ${B_OPTION}; then
		if [ "${BOOT}" == "linuxium" -a "${TARGET_PROCESSOR}" == "apollo" ]; then
			DISPLAY_MESSAGE "Boot option of 'Linuxium' cannot be specified together with '--apollo'."
			DIRTY_EXIT
		fi
	fi
	if ${S_OPTION}; then
		if [ "${TARGET_PROCESSOR}" == "apollo" ]; then
			DISPLAY_MESSAGE "Persistence cannot be specified together with '--apollo'."
			DIRTY_EXIT
		fi
	fi
	if [ "${TARGET_PROCESSOR}" == "apollo" ] && (! sudo dpkg -S systemd 2> /dev/null | grep -sq linuxx64.efi.stub); then
		DISPLAY_MESSAGE "Your distro must support 'systemd' in order to use the '--apollo' option."
		DIRTY_EXIT
	fi
	TARGET_PROCESSOR_OPTION=true
}

function PROCESS_TARGET_PROCESSOR_OPTION {
	# apollo: -b Linuxium -p binutils -f update-modules
	if [ "${TARGET_PROCESSOR}" == "apollo" ]; then
		#BOOTLOADER="bootscript-"
		USE_GRUB_BOOTLOADER=false
		BOOT="linuxium"
		USE_LINUXIUM_BOOTSCRIPT=true
		APOLLO_BINUTILS_PACKAGE="binutils"
		APOLLO_BINUTILS_PACKAGE_FOUND=false
		if ${ADD_PACKAGE}; then
			for PACKAGE_ARRAY in $(seq 0 $((${#PACKAGES[@]}-1)))
			do
				for PACKAGE in ${PACKAGES[${PACKAGE_ARRAY}]}
				do
					if [ "${PACKAGE}" == "${APOLLO_BINUTILS_PACKAGE}" ]; then
						APOLLO_BINUTILS_PACKAGE_FOUND=true
						break 2
					fi
				done
			done
		fi
		if ! ${APOLLO_BINUTILS_PACKAGE_FOUND}; then
			PACKAGE_ARRAY=${#PACKAGES[@]}
			PACKAGES[${PACKAGE_ARRAY}]+="${APOLLO_BINUTILS_PACKAGE}"
			((PACKAGE_ARRAY++))
			ADD_PACKAGE=true
		fi
		for APOLLO_ADDITIONAL_FILE in update-modules
		do
			APOLLO_ADDITIONAL_FILE_FOUND=false
			if ${ADD_FILE}; then
				for FILE_ARRAY in $(seq 0 $((${#FULLNAME_ADDITIONAL_FILES[@]}-1)))
				do
					for ADDITIONAL_FILE in ${FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]}
					do
						if [ "$(basename ${ADDITIONAL_FILE})" == "${APOLLO_ADDITIONAL_FILE}" ]; then
							APOLLO_ADDITIONAL_FILE_FOUND=true
							break 2
						fi
					done
				done
			fi
			if ! ${APOLLO_ADDITIONAL_FILE_FOUND}; then
				case ${APOLLO_ADDITIONAL_FILE} in
					"update-modules")
						DOWNLOAD_FILE http://url.linuxium.com.au/update-modules ${APOLLO_ADDITIONAL_FILE}
						;;
				esac
				if [ ! -f ${APOLLO_ADDITIONAL_FILE} ]; then
					DISPLAY_MESSAGE "Cannot fetch '${APOLLO_ADDITIONAL_FILE}' ... check your internet connection and try again."
					MESSY_EXIT
				fi
				sudo chmod +x ${APOLLO_ADDITIONAL_FILE}
				FILE_ARRAY=${#FULLNAME_ADDITIONAL_FILES[@]}
				FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]="$(readlink -f ${APOLLO_ADDITIONAL_FILE}) "
				((FILE_ARRAY++))
				ADD_FILE=true
			fi
		done
	fi
	# atom: -l rtl8723bX_4.12.0_amd64.deb -f linuxium-install-UCM-files.sh -f wrapper-linuxium-install-UCM-files.sh -f linuxium-install-broadcom-drivers.sh -f wrapper-linuxium-install-broadcom-drivers.sh -c wrapper-linuxium-install-UCM-files.sh -c wrapper-linuxium-install-broadcom-drivers.sh
	if [ "${TARGET_PROCESSOR}" == "atom" ]; then
		# backward compatibility
		[ ! $(sudo bash -c "command -v 7z") ] && echo "$(basename ${0}): Please ensure package 'p7zip-full' or equivalent for your distro is installed." && MESSY_EXIT
		LINUX_FIRMEWARE_VERSION=$(7z x -so ${ISO} ${ISO_SQUASHFS_DIRECTORY}/filesystem.${FILESYSTEM_FILES} 2> /dev/null | grep linux-firmware | sed 's/.*[[:space:]]//')
		while [[ ${LINUX_FIRMEWARE_VERSION} =~ .*\..*\..* ]]
		do
			LINUX_FIRMEWARE_VERSION=${LINUX_FIRMEWARE_VERSION%\.*}
		done
		if (( $(echo "${LINUX_FIRMEWARE_VERSION:-0} >= 1.169" | bc -l) )); then
			ATOM_WIFI_PACKAGE=rtl8723bt_4.12.0_amd64.deb
		else
			ATOM_WIFI_PACKAGE=rtl8723bs_4.12.0_amd64.deb
		fi
		ATOM_WIFI_PACKAGE_FOUND=false
		if ${ADD_LOCAL_PACKAGE}; then
			for LOCAL_PACKAGE_ARRAY in $(seq 0 $((${#LOCAL_PACKAGES[@]}-1)))
			do
				for PACKAGE in ${LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]}
				do
					if [ "$(basename ${PACKAGE})" == "rtl8723bs_4.12.0_amd64.deb" ]; then
						if (( $(echo "${LINUX_FIRMEWARE_VERSION:-0} >= 1.169" | bc -l) )); then
							DISPLAY_MESSAGE "Local package '${PACKAGE}' is not compatible with version of installed 'linux-firmware' package."
							MESSY_EXIT
						fi
						ATOM_WIFI_PACKAGE_FOUND=true
						break 2
					elif [ "$(basename ${PACKAGE})" == "rtl8723bt_4.12.0_amd64.deb" ]; then
						if (( $(echo "${LINUX_FIRMEWARE_VERSION:-0} < 1.169" | bc -l) )); then
							DISPLAY_MESSAGE "Local package '${PACKAGE}' is not compatible with version of installed 'linux-firmware' package."
							MESSY_EXIT
						fi
						ATOM_WIFI_PACKAGE_FOUND=true
						break 2
					fi
				done
			done
		fi
		if ! ${ATOM_WIFI_PACKAGE_FOUND}; then
			case ${ATOM_WIFI_PACKAGE} in
				"rtl8723bs_4.12.0_amd64.deb")
					DOWNLOAD_FILE http://url.linuxium.com.au/rtl8723bs_4_12_0_amd64_deb ${ATOM_WIFI_PACKAGE}
					;;
				"rtl8723bt_4.12.0_amd64.deb")
					DOWNLOAD_FILE http://url.linuxium.com.au/rtl8723bt_4_12_0_amd64_deb ${ATOM_WIFI_PACKAGE}
					;;
			esac
			if [ ! -f ${ATOM_WIFI_PACKAGE} ]; then
				DISPLAY_MESSAGE "Cannot fetch '${ATOM_WIFI_PACKAGE}' ... check your internet connection and try again."
				MESSY_EXIT
			fi
			LOCAL_PACKAGE_ARRAY=${#LOCAL_PACKAGES[@]}
			FULLNAME_LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]+="$(readlink -f ${ATOM_WIFI_PACKAGE})"
			BASENAME_LOCAL_PACKAGES[${LOCAL_PACKAGE_ARRAY}]+="$(basename $(readlink -f ${ATOM_WIFI_PACKAGE}))"
			((LOCAL_PACKAGE_ARRAY++))
			ADD_LOCAL_PACKAGE=true
		fi
		for ATOM_ADDITIONAL_FILE in linuxium-install-UCM-files.sh wrapper-linuxium-install-UCM-files.sh linuxium-install-broadcom-drivers.sh wrapper-linuxium-install-broadcom-drivers.sh
		do
			ATOM_ADDITIONAL_FILE_FOUND=false
			if ${ADD_FILE}; then
				for FILE_ARRAY in $(seq 0 $((${#FULLNAME_ADDITIONAL_FILES[@]}-1)))
				do
					for ADDITIONAL_FILE in ${FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]}
					do
						if [ "$(basename ${ADDITIONAL_FILE})" == "${ATOM_ADDITIONAL_FILE}" ]; then
							ATOM_ADDITIONAL_FILE_FOUND=true
							break 2
						fi
					done
				done
			fi
			if ! ${ATOM_ADDITIONAL_FILE_FOUND}; then
				case ${ATOM_ADDITIONAL_FILE} in
					"linuxium-install-UCM-files.sh")
						# kludge for 20.04 and up: actually use linuxium-install-UCM2-files.sh but renamed as linuxium-install-UCM-files.sh
						if [ "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" -o "${DISTRO_RELEASE}" == "20.04" ]; then
							DOWNLOAD_FILE http://url.linuxium.com.au/linuxium-install-UCM2-files_sh linuxium-install-UCM2-files.sh
							sudo mv linuxium-install-UCM2-files.sh ${ATOM_ADDITIONAL_FILE}
						else
							DOWNLOAD_FILE http://url.linuxium.com.au/linuxium-install-UCM-files_sh ${ATOM_ADDITIONAL_FILE}
						fi
						;;
					"wrapper-linuxium-install-UCM-files.sh")
						DOWNLOAD_FILE http://url.linuxium.com.au/wrapper-linuxium-install-UCM-files_sh ${ATOM_ADDITIONAL_FILE}
						;;
					"linuxium-install-broadcom-drivers.sh")
						DOWNLOAD_FILE http://url.linuxium.com.au/linuxium-install-broadcom-drivers_sh ${ATOM_ADDITIONAL_FILE}
						;;
					"wrapper-linuxium-install-broadcom-drivers.sh")
						DOWNLOAD_FILE http://url.linuxium.com.au/wrapper-linuxium-install-broadcom-drivers_sh ${ATOM_ADDITIONAL_FILE}
						;;
				esac
				if [ ! -f ${ATOM_ADDITIONAL_FILE} ]; then
					DISPLAY_MESSAGE "Cannot fetch '${ATOM_ADDITIONAL_FILE}' ... check your internet connection and try again."
					MESSY_EXIT
				fi
				sudo chmod +x ${ATOM_ADDITIONAL_FILE}
				FILE_ARRAY=${#FULLNAME_ADDITIONAL_FILES[@]}
				FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]="$(readlink -f ${ATOM_ADDITIONAL_FILE}) "
				((FILE_ARRAY++))
				ADD_FILE=true
			fi
		done
		for ATOM_COMMAND in wrapper-linuxium-install-UCM-files.sh wrapper-linuxium-install-broadcom-drivers.sh
		do
			ATOM_COMMAND_FOUND=false
			if ${ADD_COMMAND}; then
				for COMMAND_ARRAY in $(seq 0 $((${#COMMANDS[@]}-1)))
				do
					for COMMAND in "${COMMANDS[${COMMAND_ARRAY}]}"
					do
						if [ "${COMMAND}" == "${ATOM_COMMAND}" ]; then
							ATOM_COMMAND_FOUND=true
							break 2
						fi
					done
				done
			fi
			if ! ${ATOM_COMMAND_FOUND}; then
				COMMAND_ARRAY=${#COMMANDS[@]}
				COMMANDS[${COMMAND_ARRAY}]="${ATOM_COMMAND}"
				((COMMAND_ARRAY++))
				ADD_COMMAND=true
			fi
		done
	fi
}

function SUPPORTED { for OS in "${@:2}"; do [[ "${OS}" == "${ISO_DISTRO}" ]] && return 0; done && return 1; }

function ROLLING_FLAG { for ROLLING_OPTION in "${@:2}"; do [[ "${ROLLING_OPTION}" == "${ROLLING}" ]] && return 0; done && return 1; }

function OPTION_ISO {
	if ${I_OPTION}; then
		DISPLAY_MESSAGE "ISO already specified using '-i' or '--iso' option."
		DIRTY_EXIT
	fi
	if [ -z "${ISO}" ]; then
		DISPLAY_MESSAGE "An ISO must be specified using '-i' or '--iso' option."
		USAGE
		DIRTY_EXIT
	fi
	if [ ! -f "${ISO}" ]; then
		DISPLAY_MESSAGE "Cannot find ISO '${ISO}'."
		DIRTY_EXIT
	fi
	ISO=$(readlink -f ${ISO})
	ISO_VOLID=$(isoinfo -d -i ${ISO} 2> /dev/null | grep '^Volume id:') && ISO_VOLID=${ISO_VOLID##Volume id: }
	DISTRO_POINT_RELEASE=$(echo ${ISO_VOLID} | awk '{print $2'})
	ISO_DISTRO=${ISO_VOLID%% *}
	[ "${ISO_DISTRO}" == "Linux" ] && ISO_DISTRO=${ISO_VOLID#Linux } && ISO_DISTRO=${ISO_DISTRO%% *}
	if ( ! SUPPORTED "${ISO_DISTRO}" "${SUPPORTED_OS[@]}" ); then
		DISPLAY_MESSAGE "'${ISO}' must be an Ubuntu (or Ubuntu flavour), Linux Mint, neon, BackBox or Peppermint desktop ISO."
		DIRTY_EXIT
	fi
	DISTRO_PACKAGES="Packages.gz"
	ZIP_COMMAND="gzip"
	case "${ISO_DISTRO}" in
		"Ubuntu"|"Kubuntu"|"Lubuntu"|"Lubuntu-Next"|"Ubuntu-Budgie"|"Ubuntu-GNOME"|"Ubuntu-MATE"|"Xubuntu")
			ISO_VMLINUZ=vmlinuz.efi
			ISO_INITRD=initrd.lz
			;;
		"Ubuntu-Studio")
			KERNEL_TYPE="lowlatency"
			ISO_VMLINUZ=vmlinuz
			ISO_INITRD=initrd.lz
			;;
		"Mint")
			ISO_VMLINUZ=vmlinuz
			ISO_INITRD=initrd.lz
			;;
		"neon")
			ISO_VMLINUZ=vmlinuz.efi
			ISO_INITRD=initrd.lz
			DISTRO_PACKAGES="Packages.bz2"
			ZIP_COMMAND="bzip2"
			;;
		"BackBox")
			ISO_VMLINUZ=vmlinuz.efi
			ISO_INITRD=initrd.gz
			;;
		"Peppermint")
			ISO_VMLINUZ=vmlinuz.efi
			ISO_INITRD=initrd.lz
			;;
		*)
			DISPLAY_MESSAGE "'${ISO_DISTRO}' unknown."
			DIRTY_EXIT
			;;
	esac
	ISO_SQUASHFS_DIRECTORY=casper
	FILESYSTEM_FILES=manifest
	I_OPTION=true
}

function OPTION_WORK {
	if ${W_OPTION}; then
		DISPLAY_MESSAGE "Work directory already specified using '-w' or '--work-directory' option."
		DIRTY_EXIT
	fi
 	WORK_DIRECTORY="${WORK_DIRECTORY## }"
 	WORK_DIRECTORY="${WORK_DIRECTORY%% }"
	if [[ "${WORK_DIRECTORY}" =~ " " ]]; then
		DISPLAY_MESSAGE "Work directory '${WORK_DIRECTORY}' must not include a space in the name."
		DIRTY_EXIT
	fi
	if [ ! -d ${WORK_DIRECTORY} ]; then
		DISPLAY_MESSAGE "Cannot find work directory '${WORK_DIRECTORY}'."
		DIRTY_EXIT
	fi
	if [ -f ${WORK_DIRECTORY}/isorespin -o -d ${WORK_DIRECTORY}/isorespin ]; then
		DISPLAY_MESSAGE "Work directory '${WORK_DIRECTORY}/isorespin' already exists."
		DIRTY_EXIT
	fi
	WIP=${WORK_DIRECTORY}/isorespin
	W_OPTION=true
}

function GET_RELEASE_EOL { for NUMBER in $(seq 0 $((${#RELEASE_VERSION[@]}-1))); do [[ "${1}" == "${RELEASE_VERSION[${NUMBER}]}" ]] && DISTRO_EOL="${RELEASE_EOL[${NUMBER}]}" && return 0; done; DISTRO_EOL="" && return 1; }

function CODENAME_TO_RELEASE { for NAME in $(seq 0 $((${#RELEASE_CODENAME[@]}-1))); do [[ "${1}" == "${RELEASE_CODENAME[${NAME}]}" ]] && DISTRO_RELEASE="${RELEASE_VERSION[${NAME}]}" && return 0; done; DISTRO_RELEASE="" && return 1; }

function DOWNLOAD_FILE {
	URL="${1}"
	DOWNLOADED_FILE="${2}"
	sudo rm -rf ${DOWNLOADED_FILE}
	ID=$(wget --timeout=10 -qO- ${URL} | grep continue=https://drive.google.com | sed 's?.*continue=https://drive.google.com/file/d/??' | sed 's?/edit.*??')
	if [ -z "${ID}" ]; then
		echo "${0}: Problem identifying '${DOWNLOADED_FILE}' ... "
		return
	fi
	NUMBER_OF_ATTEMPTS=0
	MD5_CHECKSUM=$(grep "  ${DOWNLOADED_FILE}$" ${ISORESPIN_CHECKSUMS})
	VALID_MD5_CHECKSUM=$?
	if [ ${VALID_MD5_CHECKSUM} -ne 0 ]; then
		echo "${0}: Corrupt isorespin checksum file '${ISORESPIN_CHECKSUMS}' when checking for '${DOWNLOADED_FILE}' ... "
		return
	fi
	while [ "$(md5sum ${DOWNLOADED_FILE} 2> /dev/null)" != "${MD5_CHECKSUM}" -a ${NUMBER_OF_ATTEMPTS} -lt 5 ];
	do
		sudo wget --timeout=10 --load-cookies tim_tams "https://docs.google.com/uc?export=download&confirm=$(sudo wget --timeout=10 --save-cookies tim_tams --keep-session-cookies --no-check-certificate "https://docs.google.com/uc?export=download&id=${ID}" -qO- | sed -rn 's/.*confirm=([0-9A-Za-z_]+).*/\1\n/p')&id=${ID}" -qO ${DOWNLOADED_FILE}
		((NUMBER_OF_ATTEMPTS++))
	done
	if [ -f "${DOWNLOADED_FILE}" -a "$(md5sum ${DOWNLOADED_FILE} 2> /dev/null)" != "${MD5_CHECKSUM}" ]; then
		echo "${0}: Problem downloading '${DOWNLOADED_FILE}' ... "
		sudo rm -f ${DOWNLOADED_FILE}
		return
	fi
}

function GET_LATEST_ROLLING_KERNEL_VERSION {
	sudo wget --timeout=10 "${ROLLING_PACKAGES_URL}" -qO ${WIP}/Packages.gz
	if [ ! -f ${WIP}/Packages.gz ]; then
		DISPLAY_MESSAGE "Cannot fetch distro package list ... check your internet connection and try again."
		MESSY_EXIT
	fi
	if [ -n "$(zgrep "^Package: ${ROLLING_PACKAGE}$" ${WIP}/Packages.gz)" ]; then
		ROLLING_VERSION=$(zcat ${WIP}/Packages.gz | sed -n "/^Package:[ ]*${ROLLING_PACKAGE}$/,/^Filename:/ s/\.[0-9]*_amd64.deb//p" | sed 's/.*_//' | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\).\([0-9]*\).*/\1.\2.\3-\4/')
		if [ $(echo "${ROLLING_VERSION}" | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\)\-\([0-9]*\)/\1/') -gt $(echo "${ROLLING_KERNEL_VERSION}" | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\)\-\([0-9]*\)/\1/') ]; then
			ROLLING_KERNEL_VERSION=${ROLLING_VERSION}
		elif [ $(echo "${ROLLING_VERSION}" | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\)\-\([0-9]*\)/\2/') -gt $(echo "${ROLLING_KERNEL_VERSION}" | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\)\-\([0-9]*\)/\2/') ]; then
			ROLLING_KERNEL_VERSION=${ROLLING_VERSION}
		elif [ $(echo "${ROLLING_VERSION}" | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\)\-\([0-9]*\)/\3/') -gt $(echo "${ROLLING_KERNEL_VERSION}" | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\)\-\([0-9]*\)/\3/') ]; then
			ROLLING_KERNEL_VERSION=${ROLLING_VERSION}
		elif [ $(echo "${ROLLING_VERSION}" | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\)\-\([0-9]*\)/\4/') -gt $(echo "${ROLLING_KERNEL_VERSION}" | sed 's/\([0-9]*\)\.\([0-9]*\)\.\([0-9]*\)\-\([0-9]*\)/\4/') ]; then
			ROLLING_KERNEL_VERSION=${ROLLING_VERSION}
		fi
	fi
	sudo rm -f ${WIP}/Packages.gz
}

function EXTRACT_ISO {
	DISPLAY_PROGRESS "Extracting ISO ..."
	cd ${WIP}
	# mount iso
	sudo losetup -f > /dev/null 2>&1 || DISPLAY_MESSAGE "No free loop devices."
	sudo losetup -f > /dev/null 2>&1 || CLEAN_EXIT
	[ -f mnt ] && sudo rm -f mnt
	[ -d mnt ] || sudo mkdir mnt
	sudo mount -o loop ${ISO} mnt 2> /dev/null
	SUCCESSFULLY_MOUNTED=$?
	if [ ${SUCCESSFULLY_MOUNTED} != 0 ]; then
		DISPLAY_MESSAGE "Cannot mount ISO '${ISO}'."
		sudo rmdir mnt
		CLEAN_EXIT
	elif ! $(sudo grep -sqm1 amd64 mnt/.disk/info); then
		DISPLAY_MESSAGE "ISO '${ISO}' is not a 64-bit (amd64 or x86_64) ISO."
		sudo umount mnt
		sudo rmdir mnt
		CLEAN_EXIT
	elif [ ! -f mnt/${ISO_SQUASHFS_DIRECTORY}/filesystem.squashfs ]; then
		DISPLAY_MESSAGE "ISO '${ISO}' does not contain a 'squashfs' file system."
		sudo umount mnt
		sudo rmdir mnt
		CLEAN_EXIT
	fi
	# extract iso directory structure from iso
	sudo rm -rf iso-directory-structure
	sudo rsync --exclude=/${ISO_SQUASHFS_DIRECTORY}/filesystem.squashfs -a mnt/ iso-directory-structure
	# hack for "neon" ISOs which no longer conform to an Ubuntu standard format
	if [ "$(awk '{print $1}' ${WIP}/iso-directory-structure/.disk/info)" == "neon" ]; then
		DISTRO_CODENAME=$(awk '{print $3}' ${WIP}/iso-directory-structure/.disk/info | sed 's/"//g')
		DISTRO_CODENAME=${DISTRO_CODENAME,,}
	else
		DISTRO_CODENAME=$(basename "$(find ${WIP}/iso-directory-structure/dists -maxdepth 1 -type d 2> /dev/null | sed 1d)")
	fi
	if [ -z "${DISTRO_CODENAME}" ]; then
		DISPLAY_MESSAGE "Cannot determine distro codename."
		MESSY_EXIT
	fi
	CODENAME_TO_RELEASE ${DISTRO_CODENAME} # returns DISTRO_RELEASE
	if GET_RELEASE_EOL ${DISTRO_RELEASE}; then
		if [[ $((($(date -d "${DISTRO_EOL}" +%s)-$(date +%s))/60/60/24)) -lt 0 ]]; then
			DISPLAY_MESSAGE "ISO is EOL."
			MESSY_EXIT
		fi
	else
		DISPLAY_MESSAGE "Cannot determine EOL for ISO."
		MESSY_EXIT
	fi
	# new package requirement for respinning 20.04 ISOs and up
	if [ "${DISTRO_RELEASE}" == "21.10" ]; then
		[ ! $(sudo bash -c "command -v zstd") ] && echo "$(basename ${0}): Please ensure package 'zstd' or equivalent for your distro is installed." && MESSY_EXIT
		CPIO_COMPRESSION="zstd"
		UPDATE_INITRAMFS_ENVIRONMENT="CASPER_GENERATE_UUID=1"
	elif [ "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" -o "${DISTRO_RELEASE}" == "20.04" ]; then
		[ ! $(sudo bash -c "command -v lz4") ] && echo "$(basename ${0}): Please ensure package 'liblz4-tool' or equivalent for your distro is installed." && MESSY_EXIT
		CPIO_COMPRESSION="lz4"
		UPDATE_INITRAMFS_ENVIRONMENT="CASPER_GENERATE_UUID=1"
	fi
	# emergency kludge for 18.04 and 18.10 extended to 16.04, 19.04, 19.10, 20.04, 20.10, 21.04 and now 21.10
	if [ "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" -o "${DISTRO_RELEASE}" == "20.04" -o "${DISTRO_RELEASE}" == "19.10" -o "${DISTRO_RELEASE}" == "19.04" -o "${DISTRO_RELEASE}" == "18.10" -o "${DISTRO_RELEASE}" == "18.04" -o "${DISTRO_RELEASE}" == "16.04" ]; then
		ISO_VMLINUZ=$(find iso-directory-structure/casper -maxdepth 1 -name vmlinuz* -type f)
		if [ -n "${ISO_VMLINUZ}" ]; then
			ISO_VMLINUZ=$(basename $(ls -t ${ISO_VMLINUZ} | head -1))
		fi
		ISO_INITRD=$(find iso-directory-structure/casper -maxdepth 1 -name initrd* -type f)
		if [ -n "${ISO_INITRD}" ]; then
			ISO_INITRD=$(basename $(ls -t ${ISO_INITRD} | head -1))
		fi
	fi
	${SERVER_OPTION} && PROCESS_SERVER_OPTION
	${TARGET_PROCESSOR_OPTION} && PROCESS_TARGET_PROCESSOR_OPTION
	${ROLLING_KERNEL_OPTION} && PROCESS_ROLLING_KERNEL_OPTION
	# extract iso chroot file system from iso
	sudo rm -rf squashfs-root iso-chroot
	sudo unsquashfs mnt/${ISO_SQUASHFS_DIRECTORY}/filesystem.squashfs
	sudo mv squashfs-root iso-chroot
	# unmount iso
	sudo umount mnt
	sudo rmdir mnt
	if [ "${DISTRO_RELEASE}" == "22.04" ]; then
		DISPLAY_MESSAGE "Support for 22.04 ISOs and newer is available using 'isorespinner.sh'."
		CLEAN_EXIT
	fi
	# check installer as Lubuntu started using 'calamares' instead of 'ubiquity' since 18.10
	if $(sudo chroot iso-chroot dpkg-query -W -f='${Status}\n' ubiquity 2> /dev/null | grep -sq ^install); then
		INSTALLER_IS_UBIQUITY=true
		INSTALLER_IS_CALAMARES=false
	elif $(sudo chroot iso-chroot dpkg-query -W -f='${Status}\n' calamares 2> /dev/null | grep -sq ^install); then 
		INSTALLER_IS_CALAMARES=true
		INSTALLER_IS_UBIQUITY=false
	else
		DISPLAY_MESSAGE "Cannot determine installer used in ISO."
		CLEAN_EXIT
	fi
	if [ "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
		CD_BOOT_IMAGES=cd-boot-images-amd64
		CANDIDATE_CD_BOOT_IMAGES=$(sudo chroot iso-chroot apt-cache policy ${CD_BOOT_IMAGES} | grep -m1 Candidate)
		CANDIDATE_CD_BOOT_IMAGES=${CANDIDATE_CD_BOOT_IMAGES##  Candidate: }
		sudo wget --timeout=10 https://launchpad.net/ubuntu/${DISTRO_CODENAME}/amd64/${CD_BOOT_IMAGES}/${CANDIDATE_CD_BOOT_IMAGES}/+index -qO .index.html
		if [ -s .index.html ]; then
			CD_BOOT_IMAGES_PACKAGE=$(grep ${CD_BOOT_IMAGES}_${CANDIDATE_CD_BOOT_IMAGES} .index.html | sed 's/^.*href="//' | sed 's/">.*//')
			sudo rm -f .index.html
			if [ -n "${CD_BOOT_IMAGES_PACKAGE}" ]; then
				sudo wget --timeout=10 -q ${CD_BOOT_IMAGES_PACKAGE}
			fi
		fi
		if [ ! -s cd-boot-images-amd64*.deb ]; then
			DISPLAY_MESSAGE "Cannot download 'cd-boot-images' package required for building ISO."
			CLEAN_EXIT
		fi
		sudo ar x cd-boot-images-amd64_*_all.deb
		# new compression used in packaging for 21.10 and up
		if [ "${DISTRO_RELEASE}" == "21.10" ]; then
			sudo tar -I zstd -xf data.tar.zst
			sudo rm -rf cd-boot-images-amd64_*_all.deb control.tar.zst data.tar.zst debian-binary
		else
			sudo tar xf data.tar.xz
			sudo rm -rf cd-boot-images-amd64_*_all.deb control.tar.xz data.tar.xz debian-binary
		fi
		sudo mkdir cd-boot-images
		sudo mv usr cd-boot-images
	fi
	# check iso compatibility with options
	if ${TARGET_PROCESSOR_OPTION} && (! sudo chroot iso-chroot dpkg -S systemd 2> /dev/null | grep -sq linuxx64.efi.stub); then
		DISPLAY_MESSAGE "The '--${TARGET_PROCESSOR}' option is only compatible with an ISO that uses 'systemd'."
		CLEAN_EXIT
	elif ${USE_LINUXIUM_BOOTSCRIPT} && (! sudo chroot iso-chroot dpkg -S systemd 2> /dev/null | grep -sq linuxx64.efi.stub); then
		DISPLAY_MESSAGE "The '-b Linuxium' option is only compatible with an ISO that uses 'systemd'."
		CLEAN_EXIT
	fi
	echo "ISO '${ISO}' respun ..." >> ${ISORESPIN_LOGFILE}
}

function EXTRACT_ISORESPIN_FILES {
	DISPLAY_PROGRESS "Extracting isorespin files ..."
	cd ${WIP}
	sudo rm -f isorespin.zip
	sudo sed '1,/^exit 0$/d' < ${ISORESPIN_SCRIPT} | base64 -d | sudo tee isorespin.zip > /dev/null
	sudo unzip isorespin.zip > /dev/null 2>&1
	sudo rm -f isorespin.zip
}

function FETCH_MAINLINE_DEBS {
	DISPLAY_PROGRESS "Fetching mainline kernel packages ..."
	cd ${WIP}
	sudo rm -f index.html
	sudo wget --timeout=10 ${MAINLINE_URL}/${MAINLINE_BRANCH}${CURRENT} -qO index.html
	if [ ! -f index.html ]; then
		DISPLAY_MESSAGE "Cannot fetch mainline kernel index ... check your internet connection and try again."
		CLEAN_EXIT
	fi
	FETCH_FILE=$(sed -n '/href=/{/all/{/headers/s/\(^.*href="\)\([^"]\+\)\(".*\)/\2/p;};}' index.html | tail -1)
	sudo wget --timeout=10 -q ${MAINLINE_URL}/${MAINLINE_BRANCH}${CURRENT}/${FETCH_FILE}
	# starting with v5.8-rc1, v5.7.2, v5.6.18 and v5.4.46 etc (2020-07-15) and with exceptions (v5.7) the build process changed and now includes an architecture directory (amd64)
	if [ ! -f "${FETCH_FILE#amd64/}" ]; then
		DISPLAY_MESSAGE "Cannot fetch mainline header file ... check your internet connection and try again."
		CLEAN_EXIT
	fi
	FETCH_FILE=$(sed -n "/href=/{/${KERNEL_TYPE}/{/"amd64'/{/headers/s/\(^.*href="\)\([^"]\+\)\(".*\)/\2/p;};};}' index.html | tail -1)
	sudo wget --timeout=10 -q ${MAINLINE_URL}/${MAINLINE_BRANCH}${CURRENT}/${FETCH_FILE}
	if [ ! -f "${FETCH_FILE#amd64/}" ]; then
		DISPLAY_MESSAGE "Cannot fetch mainline kernel header file ... check your internet connection and try again."
		CLEAN_EXIT
	fi
	FETCH_FILE=$(sed -n "/href=/{/${KERNEL_TYPE}/{/"amd64'/{/image/s/\(^.*href="\)\([^"]\+\)\(".*\)/\2/p;};};}' index.html | tail -1)
	sudo wget --timeout=10 -q ${MAINLINE_URL}/${MAINLINE_BRANCH}${CURRENT}/${FETCH_FILE}
	if [ ! -f "${FETCH_FILE#amd64/}" ]; then
		DISPLAY_MESSAGE "Cannot fetch mainline kernel image file ... check your internet connection and try again."
		CLEAN_EXIT
	fi
	# support for separate kernel modules binary
	FETCH_FILE=$(sed -n "/href=/{/${KERNEL_TYPE}/{/"amd64'/{/modules/s/\(^.*href="\)\([^"]\+\)\(".*\)/\2/p;};};}' index.html | tail -1)
	if [ -n "${FETCH_FILE#amd64/}" ]; then
		LINUX_MODULES=true
		sudo wget --timeout=10 -q ${MAINLINE_URL}/${MAINLINE_BRANCH}${CURRENT}/${FETCH_FILE}
		if [ ! -f "${FETCH_FILE#amd64/}" ]; then
			DISPLAY_MESSAGE "Cannot fetch mainline kernel modules file ... check your internet connection and try again."
			CLEAN_EXIT
		fi
	else
		LINUX_MODULES=false
	fi
	sudo rm -f index.html
}

function PRESERVE_KEY_ISO_FILES {
	cd ${WIP}
	if [ -f iso-chroot/.isorespin.$$.do_not_touch -o -d iso-chroot/.isorespin.$$.do_not_touch ]; then
		DISPLAY_MESSAGE "Cannot create temporary isorespin directory."
		CLEAN_EXIT
	else
		sudo mkdir iso-chroot/.isorespin.$$.do_not_touch
	fi
	sudo mkdir iso-chroot/.isorespin.$$.do_not_touch/etc
	if [ -e "iso-chroot/etc/mtab" -o -h "iso-chroot/etc/mtab" ]; then
		REMOVE_ETC_MTAB=false
		RESTORE_ETC_MTAB=true
		sudo mv iso-chroot/etc/mtab iso-chroot/.isorespin.$$.do_not_touch/etc/mtab
		sudo cp -Pa iso-chroot/.isorespin.$$.do_not_touch/etc/mtab iso-chroot/etc/mtab
	else
		REMOVE_ETC_MTAB=true
		RESTORE_ETC_MTAB=false
	fi
	if [ -f iso-chroot/etc/resolv.conf -o -h iso-chroot/etc/resolv.conf ]; then
		sudo mv iso-chroot/etc/resolv.conf iso-chroot/.isorespin.$$.do_not_touch/etc/resolv.conf
	fi
	# dev media mnt opt proc run snap srv sys tmp
	for DIRECTORY in dev run tmp
	do
		sudo mv iso-chroot/${DIRECTORY} iso-chroot/.isorespin.$$.do_not_touch/${DIRECTORY}
		sudo cp -a iso-chroot/.isorespin.$$.do_not_touch/${DIRECTORY} iso-chroot/${DIRECTORY}
	done
	sudo cp /etc/resolv.conf iso-chroot/etc/
	if ! ${ADD_REPOSITORY}; then
		sudo mkdir iso-chroot/.isorespin.$$.do_not_touch/etc/apt
		sudo mv iso-chroot/etc/apt/sources.list iso-chroot/.isorespin.$$.do_not_touch/etc/apt/sources.list
		if $(grep -sqm1 "universe multiverse" iso-chroot/.isorespin.$$.do_not_touch/etc/apt/sources.list); then
			sudo cp iso-chroot/.isorespin.$$.do_not_touch/etc/apt/sources.list iso-chroot/etc/apt/sources.list
		else
			sudo sed 's/\(deb http.*\)$/\1 universe multiverse/' iso-chroot/.isorespin.$$.do_not_touch/etc/apt/sources.list | sudo tee iso-chroot/etc/apt/sources.list > /dev/null
		fi
	fi
	sudo mount -t proc none iso-chroot/proc
	sudo mount -t sysfs none iso-chroot/sys
	sudo mount --bind /dev/ iso-chroot/dev
	sudo mount -t devpts none iso-chroot/dev/pts
	sudo chroot iso-chroot apt-get update > /dev/null 2>&1
}

function RESTORE_KEY_ISO_FILES {
	cd ${WIP}
	if [ -f iso-chroot/etc/initramfs-tools/modules ]; then
		if (! grep -sq '^overlay$' iso-chroot/etc/initramfs-tools/modules); then echo overlay | sudo tee -a iso-chroot/etc/initramfs-tools/modules > /dev/null; UPDATE_INITRAMFS=true; else UPDATE_INITRAMFS=false; fi
		if (! grep -sq '^pwm-lpss$' iso-chroot/etc/initramfs-tools/modules); then echo pwm-lpss | sudo tee -a iso-chroot/etc/initramfs-tools/modules > /dev/null; UPDATE_INITRAMFS=true; else UPDATE_INITRAMFS=false; fi
		if (! grep -sq '^pwm-lpss-platform$' iso-chroot/etc/initramfs-tools/modules); then echo pwm-lpss-platform | sudo tee -a iso-chroot/etc/initramfs-tools/modules > /dev/null; UPDATE_INITRAMFS=true; else UPDATE_INITRAMFS=false; fi
	else
		UPDATE_INITRAMFS=false
	fi
	if ${UPDATE_KERNEL} || ${PURGE_PACKAGE} || ${ADD_PACKAGE} || ${ADD_LOCAL_PACKAGE}; then UPDATE_INITRAMFS=true; fi
	if ${UPDATE_INITRAMFS}; then
		sudo chroot iso-chroot bash -c "${UPDATE_INITRAMFS_ENVIRONMENT} update-initramfs -u" > /dev/null 2>&1
		LATEST_INITRD=$(find iso-chroot/boot -maxdepth 1 -name initrd* -type f)
		if [ -n "${LATEST_INITRD}" ]; then
			LATEST_INITRD=$(basename $(ls -t ${LATEST_INITRD} | head -1))
		fi
		if [ -z "${LATEST_INITRD}" ]; then
			LATEST_KERNEL=$(ls iso-chroot/lib/modules | tail -1)
		else
			LATEST_KERNEL=${LATEST_INITRD#*-}
		fi
		sudo chroot iso-chroot depmod -a ${LATEST_KERNEL} > /dev/null 2>&1
	fi
	sudo chroot iso-chroot apt-get -y autoremove --purge > /dev/null 2>&1
	sudo chroot iso-chroot apt-get -y clean > /dev/null 2>&1
	sudo sync
	sudo sync
	UMOUNT iso-chroot/dev/pts
	UMOUNT iso-chroot/dev
	UMOUNT iso-chroot/sys
	UMOUNT iso-chroot/proc
	if ! ${ADD_REPOSITORY}; then
		sudo mv iso-chroot/.isorespin.$$.do_not_touch/etc/apt/sources.list iso-chroot/etc/apt/sources.list
		sudo rmdir iso-chroot/.isorespin.$$.do_not_touch/etc/apt
	fi
	if [ -f iso-chroot/.isorespin.$$.do_not_touch/etc/resolv.conf -o -h iso-chroot/.isorespin.$$.do_not_touch/etc/resolv.conf ]; then
		sudo mv iso-chroot/.isorespin.$$.do_not_touch/etc/resolv.conf iso-chroot/etc/resolv.conf
	fi
	if ${REMOVE_ETC_MTAB}; then
		sudo rm -rf iso-chroot/etc/mtab
	elif ${RESTORE_ETC_MTAB}; then
		sudo rm -rf iso-chroot/etc/mtab
		sudo mv iso-chroot/.isorespin.$$.do_not_touch/etc/mtab iso-chroot/etc/mtab
	fi
	sudo rmdir iso-chroot/.isorespin.$$.do_not_touch/etc
	for DIRECTORY in dev run tmp
	do
		sudo rm -rf iso-chroot/${DIRECTORY}
		sudo mv iso-chroot/.isorespin.$$.do_not_touch/${DIRECTORY} iso-chroot/${DIRECTORY}
	done
	sudo rmdir iso-chroot/.isorespin.$$.do_not_touch
	sudo rm -f iso-chroot/var/lib/dpkg/status-old
	sudo rm -f iso-chroot/boot/grub/grub.cfg
	sudo rm -f iso-chroot/root/.bash_history
}

function UPDATE_ISO_KERNEL_AND_INITRAMFS {
	LATEST_INITRD=$(find iso-chroot/boot -maxdepth 1 -name initrd* -type f)
	if [ -n "${LATEST_INITRD}" ]; then
		LATEST_INITRD=$(ls -t ${LATEST_INITRD} | head -1)
		if [ -n "${LATEST_INITRD}" ]; then
			sudo cp ${LATEST_INITRD} iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_INITRD}
		fi
	fi
	LATEST_RELEASE=${LATEST_INITRD#iso-chroot/boot/initrd.img-}
	LATEST_VMLINUZ=$(find iso-chroot/boot -maxdepth 1 -name vmlinuz-${LATEST_RELEASE}.efi.signed -type f)
	if [ -n "${LATEST_VMLINUZ}" ]; then
		LATEST_VMLINUZ=$(ls -t ${LATEST_VMLINUZ} | head -1)
		if [ -n "${LATEST_VMLINUZ}" ]; then
			sudo cp ${LATEST_VMLINUZ} iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_VMLINUZ}
		fi
	else
		LATEST_VMLINUZ=$(find iso-chroot/boot -maxdepth 1 -name vmlinuz-${LATEST_RELEASE} -type f)
		if [ -n "${LATEST_VMLINUZ}" ]; then
			LATEST_VMLINUZ=$(ls -t ${LATEST_VMLINUZ} | head -1)
			if [ -n "${LATEST_VMLINUZ}" ]; then
				sudo cp ${LATEST_VMLINUZ} iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_VMLINUZ}
			fi
		fi
	fi
}

function INTERACTION {
	DISPLAY_PROGRESS "Starting interaction with distro ..."
	cd ${WIP}
	sudo rm -f interactive.log
	PRESERVE_KEY_ISO_FILES
	sudo script -qc "sudo HOME=/root LC_ALL=C chroot iso-chroot /bin/bash" interactive.log
	DISPLAY_PROGRESS "Finishing interaction with distro ..."
	RESTORE_KEY_ISO_FILES
	UPDATE_ISO_KERNEL_AND_INITRAMFS
	echo "Starting interaction with distro ..." >> ${ISORESPIN_LOGFILE}
	if ${DEBUG}; then
		sudo cat interactive.log | sed '1d' | sed 'N;$!P;$!D;$d' >> ${ISORESPIN_LOGFILE}
	else
		while read -r
		do
			if [ -n "${REPLY}" ]; then
				echo "Command '${REPLY}' ran ..." >> ${ISORESPIN_LOGFILE}
			fi
		done <<< $(sudo sed 's/\x1B\]0;/\n/' interactive.log | tr -d '\r' | grep "^[^@]*@$(hostname -s)" | sed 's/^[^ ]* [^ ]* //')
	fi
	echo "Finishing interaction with distro ..." >> ${ISORESPIN_LOGFILE}
}

