function INSTALL_MAINLINE_KERNEL {
	DISPLAY_PROGRESS "Installing mainline kernel packages ..."
	cd ${WIP}
	sudo cp linux-headers*.deb iso-chroot/usr/src/
	sudo cp linux-image*.deb iso-chroot/usr/src/
	if ${LINUX_MODULES}; then
		sudo cp linux-modules*.deb iso-chroot/usr/src/
	fi
	MAINLINE_KERNEL_IMAGE=$(find iso-chroot/usr/src -maxdepth 1 -name linux-image-* -type f)
	if [ -n "${MAINLINE_KERNEL_IMAGE}" ]; then
		MAINLINE_KERNEL_IMAGE=$(ls -t ${MAINLINE_KERNEL_IMAGE} | head -1)
	fi
	if ${LINUX_MODULES}; then
		MAINLINE_KERNEL_RELEASE=${MAINLINE_KERNEL_IMAGE#iso-chroot/usr/src/linux-image-unsigned-}
	else
		MAINLINE_KERNEL_RELEASE=${MAINLINE_KERNEL_IMAGE#iso-chroot/usr/src/linux-image-}
	fi
	MAINLINE_KERNEL_RELEASE=${MAINLINE_KERNEL_RELEASE%%_*}
	sudo rm -f iso-chroot/usr/src/.kernel.log iso-chroot/usr/src/.kernel.error
	PRESERVE_KEY_ISO_FILES
	sudo chroot iso-chroot /bin/bash > /dev/null 2>&1 <<+
export HOME=/root
export LC_ALL=C
trap '' SIGHUP SIGINT SIGTERM
cd /usr/src
if ${DEBUG}; then echo "Installing '$(ls linux*.deb)' ..." > .kernel.log; fi
dpkg -i linux*.deb >> .kernel.log 2>&1
SUCCESSFULLY_INSTALLED=\$?
if [ \${SUCCESSFULLY_INSTALLED} != 0 ]; then
	touch .kernel.failed
else
	rm -f linux*.deb
fi
+
	if ${DEBUG}; then sudo cat iso-chroot/usr/src/.kernel.log >> ${ISORESPIN_LOGFILE}; fi
	if [ -f iso-chroot/usr/src/.kernel.failed ]; then
		sudo cat iso-chroot/usr/src/.kernel.log
		DISPLAY_MESSAGE "Updating kernel to '${MAINLINE_KERNEL_RELEASE}' failed."
		sudo rm -f iso-chroot/usr/src/.kernel.error iso-chroot/usr/src/.kernel.log
		CHROOT_EXIT
	else
		sudo rm -f iso-chroot/usr/src/.kernel.log
	fi
	RESTORE_KEY_ISO_FILES
	UPDATE_ISO_KERNEL_AND_INITRAMFS
	if [ -z "${LATEST_VMLINUZ}" ]; then
		DISPLAY_MESSAGE "Cannot find mainline kernel."
		CLEAN_EXIT
	elif [ ! -f "${LATEST_VMLINUZ}" ]; then
		DISPLAY_MESSAGE "Mainline kernel '${LATEST_VMLINUZ}' missing."
		CLEAN_EXIT
	fi
	if [ -z "${LATEST_INITRD}" ]; then
		DISPLAY_MESSAGE "Cannot find mainline initramfs."
		CLEAN_EXIT
	elif [ ! -f "${LATEST_INITRD}" ]; then
		DISPLAY_MESSAGE "Mainline initramfs '${LATEST_INITRD}' missing."
		CLEAN_EXIT
	fi
	sudo rm -f linux-headers*.deb
	sudo rm -f linux-image*.deb
	sudo rm -f linux-modules*.deb
	echo "Kernel updated with mainline kernel version '${MAINLINE_KERNEL_RELEASE}' ..." >> ${ISORESPIN_LOGFILE}
