	for DOWNLOAD_ARRAY in $(seq 0 $((${#DOWNLOADS[@]}-1)))
	do
		PACKAGES_TO_DOWNLOAD=${DOWNLOADS[${DOWNLOAD_ARRAY}]}
		sudo chroot iso-chroot /bin/bash > /dev/null 2>&1 <<+
export HOME=/root
export LC_ALL=C
trap '' SIGHUP SIGINT SIGTERM
cd /usr/src
if ${DEBUG}; then echo "Downloading package '${PACKAGES_TO_DOWNLOAD}' ..." > .package.log; fi
for PACKAGE in ${PACKAGES_TO_DOWNLOAD}
do
	if (! apt-cache show \${PACKAGE} > /dev/null 2>&1); then
		echo "Unable to locate package \${PACKAGE}" >> .package.log
		echo "\${PACKAGE}" > .package.error
		break
	fi
done
if [ ! -f .package.error ]; then
	apt-get download -y ${PACKAGES_TO_DOWNLOAD} >> .package.log 2>&1
	PACKAGE_DOWNLOADED=\$?
	if [ \${PACKAGE_DOWNLOADED} != 0 ]; then
		echo "${PACKAGES_TO_DOWNLOAD}" > .package.error
	fi
fi
+
		if ${DEBUG}; then sudo cat iso-chroot/usr/src/.package.log >> ${ISORESPIN_LOGFILE}; fi
		if [ -f iso-chroot/usr/src/.package.error ]; then
			PACKAGE=$(sudo cat iso-chroot/usr/src/.package.error)
			sudo cat iso-chroot/usr/src/.package.log
			DISPLAY_MESSAGE "'${PACKAGE}' failed to download correctly."
			sudo rm -f iso-chroot/usr/src/.package.failed iso-chroot/usr/src/.package.log
			CHROOT_EXIT
		else
			echo "Package '${PACKAGES_TO_DOWNLOAD}' downloaded ..." >> ${ISORESPIN_LOGFILE}
			sudo rm -f iso-chroot/usr/src/.package.log
		fi
	done
	RESTORE_KEY_ISO_FILES
}

function ADD_FILES {
	DISPLAY_PROGRESS "Adding files/directories ..."
	cd ${WIP}
	sudo mkdir -p iso-chroot/usr/local/bin
	for FILE_ARRAY in $(seq 0 $((${#FULLNAME_ADDITIONAL_FILES[@]}-1)))
	do
		for FILES_TO_ADD in ${FULLNAME_ADDITIONAL_FILES[${FILE_ARRAY}]}
		do
			for ADDITIONAL_FILE in ${FILES_TO_ADD}
			do
				if [ -f ${ADDITIONAL_FILE} ]; then
					sudo cp ${ADDITIONAL_FILE} iso-chroot/usr/local/bin
					echo "File '${ADDITIONAL_FILE}' added ..." >> ${ISORESPIN_LOGFILE}
				else
					sudo cp -a ${ADDITIONAL_FILE} iso-chroot/usr/local/bin
					echo "Directory '${ADDITIONAL_FILE}' added ..." >> ${ISORESPIN_LOGFILE}
				fi
			done
		done
	done
}

function RUN_COMMANDS {
	DISPLAY_PROGRESS "Running commands ..."
	cd ${WIP}
	sudo rm -f iso-chroot/root/.command.log iso-chroot/root/.command.error
	PRESERVE_KEY_ISO_FILES
	for COMMAND_ARRAY in $(seq 0 $((${#COMMANDS[@]}-1)))
	do
		COMMAND="${COMMANDS[${COMMAND_ARRAY}]}"
		sudo chroot iso-chroot /bin/bash > /dev/null 2>&1 <<+
export HOME=/root
export LC_ALL=C
trap '' SIGHUP SIGINT SIGTERM
[[ \$PATH =~ .*/usr/local/bin:.* ]] || export PATH=/usr/local/bin:\$PATH
cd /root
if ${DEBUG}; then echo "Running '${COMMAND}' ..." > .command.log; fi
bash -c "${COMMAND}" >> .command.log 2>&1
COMMAND_SUCCESSFUL=\$?
if [ \${COMMAND_SUCCESSFUL} != 0 ]; then
	touch .command.error
fi
+
		if ${DEBUG}; then sudo cat iso-chroot/root/.command.log >> ${ISORESPIN_LOGFILE}; fi
		if sudo -s test -f iso-chroot/root/.command.error; then
			sudo cat iso-chroot/root/.command.log
			DISPLAY_MESSAGE "'${COMMAND}' failed to run correctly."
			sudo rm -f iso-chroot/root/.command.error iso-chroot/root/.command.log
			CHROOT_EXIT
		else
			echo "Command '${COMMAND}' ran ..." >> ${ISORESPIN_LOGFILE}
			sudo rm -f iso-chroot/root/.command.log
		fi
	done
	RESTORE_KEY_ISO_FILES
	for COMMAND_ARRAY in $(seq 0 $((${#COMMANDS[@]}-1)))
	do
		COMMAND="${COMMANDS[${COMMAND_ARRAY}]}"
		if [ "${COMMAND:0:16}" == "update-initramfs" -o "${COMMAND:0:39}" == "CASPER_GENERATE_UUID=1 update-initramfs" ]; then
			UPDATE_ISO_KERNEL_AND_INITRAMFS
			if [ -n "${LATEST_INITRD}" ]; then echo "ISO initramfs updated with '$(basename ${LATEST_INITRD})'." >> ${ISORESPIN_LOGFILE}; fi
			if [ -n "${LATEST_VMLINUZ}" ]; then echo "ISO kernel updated with '$(basename ${LATEST_VMLINUZ})'." >> ${ISORESPIN_LOGFILE}; fi
		fi
	done
}

function EXTRACT_FILES {
	DISPLAY_PROGRESS "Outputting files/directories ..."
	cd ${WIP}
	sudo mkdir output > /dev/null 2>&1
	for OUTPUT_FILE_ARRAY in $(seq 0 $((${#OUTPUT_FILES[@]}-1)))
	do
		for FILES_TO_OUTPUT in ${OUTPUT_FILES[${OUTPUT_FILE_ARRAY}]}
		do
			for OUTPUT_FILE in ${FILES_TO_OUTPUT}
			do
				if [ ! -e iso-chroot/${OUTPUT_FILE} ]; then
					DISPLAY_MESSAGE "Output file/directory '${OUTPUT_FILE}' not found."
					CLEAN_EXIT
				elif [ -d iso-chroot/${OUTPUT_FILE} ]; then
					OUTPUT_DIRNAME=$(dirname ${OUTPUT_FILE})
					sudo mkdir -p output/${OUTPUT_DIRNAME} > /dev/null 2>&1
					sudo cp -a iso-chroot/${OUTPUT_FILE} output/${OUTPUT_FILE} > /dev/null 2>&1
					echo "Directory '${OUTPUT_FILE}' output ..." >> ${ISORESPIN_LOGFILE}
				elif [ -f iso-chroot/${OUTPUT_FILE} ]; then
					OUTPUT_DIRNAME=$(dirname ${OUTPUT_FILE})
					sudo mkdir -p output/${OUTPUT_DIRNAME} > /dev/null 2>&1
					sudo cp iso-chroot/${OUTPUT_FILE} output/${OUTPUT_FILE} > /dev/null 2>&1
					echo "File '${OUTPUT_FILE}' output ..." >> ${ISORESPIN_LOGFILE}
				else
					DISPLAY_MESSAGE "Output file '${OUTPUT_FILE}' incorrect file type ... ignored."
					CLEAN_EXIT
				fi
			done
		done
	done
}

function ADD_32BIT_GRUB_PACKAGES {
	cd ${WIP}
	if [ ! -f iso-directory-structure/dists/${DISTRO_CODENAME}/main/binary-amd64/${DISTRO_PACKAGES} ]; then
			DISPLAY_MESSAGE "Cannot add 32-bit GRUB packages."
			CLEAN_EXIT
	else
		DISPLAY_PROGRESS "Adding 32-bit GRUB packages ..."
	fi
	GRUB_EFI_IA32=grub-efi-ia32
	CANDIDATE_GRUB_EFI_IA32=$(sudo chroot iso-chroot apt-cache policy ${GRUB_EFI_IA32} | grep -m1 Candidate)
	CANDIDATE_GRUB_EFI_IA32=${CANDIDATE_GRUB_EFI_IA32##  Candidate: }
	GRUB_EFI_IA32_BIN=grub-efi-ia32-bin
	CANDIDATE_GRUB_EFI_IA32_BIN=$(sudo chroot iso-chroot apt-cache policy ${GRUB_EFI_IA32_BIN} | grep -m1 Candidate)
	CANDIDATE_GRUB_EFI_IA32_BIN=${CANDIDATE_GRUB_EFI_IA32_BIN##  Candidate: }
	sudo wget --timeout=10 https://launchpad.net/ubuntu/${DISTRO_CODENAME}/amd64/${GRUB_EFI_IA32}/${CANDIDATE_GRUB_EFI_IA32}/+index -qO .index.html
	if [ -s .index.html ]; then
		GRUB_EFI_PACKAGE_TO_DOWNLOAD=$(grep ${GRUB_EFI_IA32}_${CANDIDATE_GRUB_EFI_IA32} .index.html | sed 's/^.*href="//' | sed 's/">.*//')
		sudo rm -f .index.html
		if [ -n "${GRUB_EFI_PACKAGE_TO_DOWNLOAD}" ]; then
			sudo wget --timeout=10 -q ${GRUB_EFI_PACKAGE_TO_DOWNLOAD}
		fi
	fi
	if [ -s grub-efi-ia32*.deb ]; then
		sudo wget --timeout=10 https://launchpad.net/ubuntu/${DISTRO_CODENAME}/amd64/${GRUB_EFI_IA32_BIN}/${CANDIDATE_GRUB_EFI_IA32_BIN}/+index -qO .index.html
		if [ -s .index.html ]; then
			GRUB_EFI_PACKAGE_TO_DOWNLOAD=$(grep ${GRUB_EFI_IA32_BIN}_${CANDIDATE_GRUB_EFI_IA32_BIN} .index.html | sed 's/^.*href="//' | sed 's/">.*//')
			sudo rm -f .index.html
			if [ -n "${GRUB_EFI_PACKAGE_TO_DOWNLOAD}" ]; then
				sudo wget --timeout=10 -q ${GRUB_EFI_PACKAGE_TO_DOWNLOAD}
			fi
		fi
		if [ -s grub-efi-ia32-bin*.deb ]; then
			if [ "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
				if [ -d iso-directory-structure/pool/main ]; then
					if [ ! -d iso-directory-structure/pool/main/g/grub2 ]; then
						sudo mkdir -p iso-directory-structure/pool/main/g/grub2
						sudo chmod 555 iso-directory-structure/pool/main/g iso-directory-structure/pool/main/g/grub2
					fi
				else
					DISPLAY_MESSAGE "Could not add 32-bit GRUB packages."
					CLEAN_EXIT
				fi
			fi
			sudo rm -f iso-directory-structure/pool/main/g/grub2/grub-efi-ia32*.deb
			sudo mv grub-efi-ia32*.deb iso-directory-structure/pool/main/g/grub2
			sudo chmod 444 iso-directory-structure/pool/main/g/grub2/grub-efi-ia32*.deb
			echo "32-bit GRUB packages added ..." >> ${ISORESPIN_LOGFILE}
		else
			DISPLAY_WARNING "Failed to add 32-bit GRUB packages ..."
 			sudo rm -f grub-efi-ia32*.deb
		fi
	else
		DISPLAY_WARNING "Failed to add 32-bit GRUB packages ..."
 		sudo rm -f grub-efi-ia32*.deb
	fi
}

function FETCH_REFIND_FILES {
	REFIND_DIR=$(ls -C1dr ${CWD}/refind-bin-* 2> /dev/null | head -1)
	if [ ! -f ${REFIND_DIR}/refind/refind.conf-sample ]; then
		REFIND_URL="https://sourceforge.net/projects/refind/files"
		REFIND_DOWNLOAD_URL="https://downloads.sourceforge.net/project/refind"
		sudo rm -f ${WIP}/refind_index.html
		sudo wget --timeout=10 "${REFIND_URL}" -qO ${WIP}/refind_index.html
		if [ ! -f ${WIP}/refind_index.html ]; then
			DISPLAY_MESSAGE "Cannot fetch rEFInd index ... check your internet connection and try again."
			CLEAN_EXIT
		fi
		REFIND_LATEST_VERSION=$(grep /projects/refind/files/latest/download ${WIP}/refind_index.html | sed 's/.*title="\/\([^\/]*\).*/\1/')
		REFIND_ZIPFILE=$(grep /projects/refind/files/latest/download ${WIP}/refind_index.html | sed 's/.*\///' | sed 's/:.*//')
		if [ -z "${REFIND_ZIPFILE}" ]; then
			DISPLAY_PROGRESS "sourceforge.net is down so trying alternate ..."
			REFIND_LATEST_VERSION=$(grep 'a href="/projects/refind/files' ${WIP}/refind_index.html | grep timeline | grep -v themes | sed 's?.*a href="/projects/refind/files/??' | sed 's?/stats/timeline".*??' | head -1)
			REFIND_DOWNLOAD_URL="wget http://sourceforge.mirrorservice.org/r/re/refind"
			REFIND_ZIPFILE="refind-bin-${REFIND_LATEST_VERSION}.zip"
		fi
		sudo rm -rf ${WIP}/${REFIND_ZIPFILE}
		sudo wget --timeout=10 ${REFIND_DOWNLOAD_URL}/${REFIND_LATEST_VERSION}/${REFIND_ZIPFILE} -qO ${WIP}/${REFIND_ZIPFILE}
		if [ ! -s "${WIP}/${REFIND_ZIPFILE}" ]; then
			DISPLAY_MESSAGE "Cannot download rEFInd ... try downloading it manually and then re-running 'isorespin.sh'."
			CLEAN_EXIT
		fi
		sudo unzip ${WIP}/${REFIND_ZIPFILE} -d ${WIP} > /dev/null 2>&1
		sudo rm -f ${WIP}/refind_index.html ${WIP}/${REFIND_ZIPFILE}
		REFIND_DIR=${WIP}/"refind-bin-${REFIND_LATEST_VERSION}"
		REFIND_DIR=$(readlink -f ${REFIND_DIR})
		if [ ! -d "${REFIND_DIR}" ]; then
			REFIND_DIR=$(ls ${WIP})
			REFIND_DIR=$(readlink -f ${WIP}/${REFIND_DIR})
		fi
	else
		REFIND_DIR=$(readlink -f ${REFIND_DIR})
	fi
	if [ ! -d "${REFIND_DIR}" ]; then
		DISPLAY_MESSAGE "Cannot access rEFInd directory."
		CLEAN_EXIT
	fi
}

function UPDATE_BOOTLOADER {
	DISPLAY_PROGRESS "Processing bootloader/bootmanager ..."
	cd ${WIP}
	if ${SERVER_OPTION}; then
		sudo sed -i '/[Ii]nstall /,/\}/d' iso-directory-structure/boot/grub/grub.cfg
		# boots 'oem' kernel on Intel Compute Sticks so prevents this on every device by removing it
		sudo sed -i 's/\$casper_flavour//' iso-directory-structure/boot/grub/grub.cfg
	fi
	if ${ADD_PERSISTENCE}; then
		if [ "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" -o "${DISTRO_RELEASE}" == "20.04" ]; then
			PERSISTENCE_PARTITION=writable
		else
			PERSISTENCE_PARTITION=casper-rw
		fi
		ADD_KERNEL_BOOT_PARAMETER=true
		KERNEL_BOOT_PARAMETER+=" ${PERSISTENCE}"
	fi
	case "${ISO_DISTRO}" in
		"Ubuntu-Studio")
			PRESEED_SEED="ubuntustudio.seed"
			;;
		"Mint")
			PRESEED_SEED="linuxmint.seed"
			;;
		*)
			PRESEED_SEED="${ISO_DISTRO,,}.seed"
			;;
	esac
	# 20.04 and up no longer uses 'boot=casper' in 'grub.cfg' and now uses 'maybe-ubiquity'
	if $(grep -sqm1 "boot=casper" iso-directory-structure/boot/grub/grub.cfg); then
		BOOT_CASPER=true
		REFIND_BOOT_PARAMETERS="boot=casper"
	else
		BOOT_CASPER=false
		REFIND_BOOT_PARAMETERS="maybe-ubiquity"
		if ${SERVER_OPTION}; then
			sudo sed -i 's/maybe-ubiquity//' iso-directory-structure/boot/grub/grub.cfg
			REFIND_BOOT_PARAMETERS=""
		fi
	fi
	sudo cp iso-chroot/etc/default/grub iso-chroot/etc/default/grub.orig
	LINUXIUM_BOOT_PARAMETERS=""
	CURRENT_KERNEL_BOOT_PARAMETER=$(grep -m1 "^GRUB_CMDLINE_LINUX_DEFAULT=" iso-chroot/etc/default/grub)
	CURRENT_KERNEL_BOOT_PARAMETER=${CURRENT_KERNEL_BOOT_PARAMETER#GRUB_CMDLINE_LINUX_DEFAULT=}
	CURRENT_KERNEL_BOOT_PARAMETER=${CURRENT_KERNEL_BOOT_PARAMETER//\"/}
	if [ -n "${CURRENT_KERNEL_BOOT_PARAMETER}" ]; then
		REFIND_BOOT_PARAMETERS+=" ${CURRENT_KERNEL_BOOT_PARAMETER}"
		LINUXIUM_BOOT_PARAMETERS+="${CURRENT_KERNEL_BOOT_PARAMETER}"
		if ${ADD_KERNEL_BOOT_PARAMETER}; then
			KERNEL_BOOT_PARAMETER="${KERNEL_BOOT_PARAMETER:1}"
			sudo sed -i "s/${CURRENT_KERNEL_BOOT_PARAMETER}/${CURRENT_KERNEL_BOOT_PARAMETER} ${KERNEL_BOOT_PARAMETER}/" iso-directory-structure/boot/grub/grub.cfg
			sudo sed -i "s/${CURRENT_KERNEL_BOOT_PARAMETER}/${CURRENT_KERNEL_BOOT_PARAMETER} ${KERNEL_BOOT_PARAMETER}/" iso-chroot/etc/default/grub
			REFIND_BOOT_PARAMETERS+=" ${KERNEL_BOOT_PARAMETER}"
			LINUXIUM_BOOT_PARAMETERS+=" ${KERNEL_BOOT_PARAMETER}"
			echo "Kernel boot parameters '${KERNEL_BOOT_PARAMETER}' added ..." >> ${ISORESPIN_LOGFILE}
		fi
		if ${DELETE_KERNEL_BOOT_PARAMETERS}; then
			sudo sed -i "s/ ${CURRENT_KERNEL_BOOT_PARAMETER}//" iso-directory-structure/boot/grub/grub.cfg
			if ${ADD_KERNEL_BOOT_PARAMETER}; then
				sudo sed -i "s/${CURRENT_KERNEL_BOOT_PARAMETER} //" iso-chroot/etc/default/grub
				LINUXIUM_BOOT_PARAMETERS=${LINUXIUM_BOOT_PARAMETERS/${CURRENT_KERNEL_BOOT_PARAMETER} /}
			else
				sudo sed -i "s/${CURRENT_KERNEL_BOOT_PARAMETER}//" iso-chroot/etc/default/grub
				LINUXIUM_BOOT_PARAMETERS=${LINUXIUM_BOOT_PARAMETERS/${CURRENT_KERNEL_BOOT_PARAMETER}/}
			fi
			REFIND_BOOT_PARAMETERS=${REFIND_BOOT_PARAMETERS/ ${CURRENT_KERNEL_BOOT_PARAMETER}/}
			echo "Initial kernel boot parameters '${CURRENT_KERNEL_BOOT_PARAMETER}' deleted ..." >> ${ISORESPIN_LOGFILE}
		fi
	else
		if ${ADD_KERNEL_BOOT_PARAMETER}; then
			KERNEL_BOOT_PARAMETER="${KERNEL_BOOT_PARAMETER:1}"
			if ${BOOT_CASPER}; then
				sudo sed -i "s/boot=casper/boot=casper ${KERNEL_BOOT_PARAMETER}/" iso-directory-structure/boot/grub/grub.cfg
			else
				if (! grep -sq ${PRESEED_SEED} iso-directory-structure/boot/grub/grub.cfg); then
					sudo sed -i "s/linux\(\s*\)\/casper\/\(\S*\)\(\s*\)/linux\1\/casper\/\2\3file=\/cdrom\/preseed\/${PRESEED_SEED}\3/" iso-directory-structure/boot/grub/grub.cfg
				fi
				sudo sed -i "s/${PRESEED_SEED}/${PRESEED_SEED} ${KERNEL_BOOT_PARAMETER}/" iso-directory-structure/boot/grub/grub.cfg
			fi
			sudo sed -i "s/^GRUB_CMDLINE_LINUX_DEFAULT=\"\"/GRUB_CMDLINE_LINUX_DEFAULT=\"${KERNEL_BOOT_PARAMETER}\"/" iso-chroot/etc/default/grub
			REFIND_BOOT_PARAMETERS+=" ${KERNEL_BOOT_PARAMETER}"
			LINUXIUM_BOOT_PARAMETERS+="${KERNEL_BOOT_PARAMETER}"
			echo "Kernel boot parameters '${KERNEL_BOOT_PARAMETER}' added ..." >> ${ISORESPIN_LOGFILE}
		fi
		if ${DELETE_KERNEL_BOOT_PARAMETERS}; then
			echo "No initial kernel boot parameters found for deletion ..." >> ${ISORESPIN_LOGFILE}
		fi
	fi
	# persistence must not be persistent
	sudo sed -i 's/"persistent"/""/' iso-chroot/etc/default/grub
	sudo sed -i 's/"persistent[ ]\+/"/' iso-chroot/etc/default/grub
	sudo sed -i 's/[ ]\+persistent[ ]\+/ /' iso-chroot/etc/default/grub
	sudo sed -i 's/[ ]\+persistent"/"/' iso-chroot/etc/default/grub
	if (${USE_GRUB_BOOTLOADER} || ${USE_LINUXIUM_BOOTSCRIPT}) && (${ADD_KERNEL_BOOT_PARAMETER} || ${DELETE_KERNEL_BOOT_PARAMETERS}); then
		# use preseed file if missing from distro grub.cfg
		if (! grep -sq ${PRESEED_SEED} iso-directory-structure/boot/grub/grub.cfg); then
			if ${BOOT_CASPER}; then
				sudo sed -i "s/boot=casper/file=\/cdrom\/preseed\/${PRESEED_SEED} boot=casper/" iso-directory-structure/boot/grub/grub.cfg
			else
				sudo sed -i "s/linux\(\s*\)\/casper\/\(\S*\)\(\s*\)/linux\1\/casper\/\2\3file=\/cdrom\/preseed\/${PRESEED_SEED}\3/" iso-directory-structure/boot/grub/grub.cfg
			fi
		fi
		# and for completeness
		if (! grep -sq ${PRESEED_SEED} iso-directory-structure/boot/grub/loopback.cfg); then
			if ${BOOT_CASPER}; then
				sudo sed -i "s/boot=casper/file=\/cdrom\/preseed\/${PRESEED_SEED} boot=casper/" iso-directory-structure/boot/grub/loopback.cfg
			else
				sudo sed -i "s/linux\(\s*\)\/casper\/\(\S*\)\(\s*\)/linux\1\/casper\/\2\3file=\/cdrom\/preseed\/${PRESEED_SEED}\3/" iso-directory-structure/boot/grub/loopback.cfg
			fi
		fi
		sudo cp iso-chroot/etc/default/grub iso-chroot/etc/default/grub.isorespin
		# add preseed if missing from distro
		sudo mkdir -p iso-directory-structure/preseed && sudo chmod 555 iso-directory-structure/preseed && sudo touch iso-directory-structure/preseed/${PRESEED_SEED} && sudo chmod 444 iso-directory-structure/preseed/${PRESEED_SEED}
		if ! $(diff iso-chroot/etc/default/grub.orig iso-chroot/etc/default/grub > /dev/null 2>&1); then
			# create generic preseed file
			sudo cat <<+ | sudo tee -a iso-directory-structure/preseed/${PRESEED_SEED} > /dev/null
# Linuxium 'isorespin.sh' customization: Begin
# ubiquity	ubiquity/success_command string \\
# TARGET=MOUNT_POINT; \\
# mv \${TARGET}/etc/default/grub.isorespin \${TARGET}/etc/default/grub
# Linuxium 'isorespin.sh' customization: End
+
			if ${INSTALLER_IS_UBIQUITY}; then
				sudo sed -i '/^# Linuxium.*Begin/,/^# Linuxium.*End/s/^# //' iso-directory-structure/preseed/${PRESEED_SEED}
				sudo sed -i 's/^Linuxium/# Linuxium/' iso-directory-structure/preseed/${PRESEED_SEED}
				sudo sed -i 's/TARGET=MOUNT_POINT/TARGET=\/target/' iso-directory-structure/preseed/${PRESEED_SEED}
			fi
			if ${INSTALLER_IS_CALAMARES}; then
				sudo sed '/^# Linuxium.*Begin/,/^# Linuxium.*End/!d;//d;s/# //;s/; \\$//;s/MOUNT_POINT/$1/;/^ubiquity/c #!/bin/sh' iso-directory-structure/preseed/${PRESEED_SEED} | sudo tee iso-chroot/etc/calamares/modules/isorespin > /dev/null
				sudo chmod 700 iso-chroot/etc/calamares/modules/isorespin
				sudo sed -i "/id: logs/i - id: isorespin\n\\ \\ module: shellprocess\n\\ \\ config: shellprocess_isorespin.conf" iso-chroot/etc/calamares/settings.conf
				sudo sed -i "/packages/i \\ \\ - shellprocess@isorespin" iso-chroot/etc/calamares/settings.conf
				sudo cat <<+ | sudo tee iso-chroot/etc/calamares/modules/shellprocess_isorespin.conf > /dev/null
---
dontChroot: true
timeout: 10
script:
    - /etc/calamares/modules/isorespin @@ROOT@@
    - rm -f @@ROOT@@/etc/calamares/modules/isorespin @@ROOT@@/etc/calamares/modules/shellprocess_isorespin.conf
+
			fi
		fi
	fi
	sudo rm -f iso-chroot/etc/default/grub.orig
	if ${USE_LINUXIUM_BOOTSCRIPT}; then
		sudo mkdir -p iso-chroot/etc/initramfs/post-update.d
		sudo cp linuxium-bootscript iso-chroot/etc/initramfs/post-update.d
		echo "Bootscript 'Linuxium' added ..." >> ${ISORESPIN_LOGFILE}
	fi
	if ${USE_REFIND_BOOTMANAGER}; then
		FETCH_REFIND_FILES
		# use preseed file if missing from distro grub.cfg
		if (! grep -sq ${PRESEED_SEED} iso-directory-structure/boot/grub/grub.cfg); then
			if ${BOOT_CASPER}; then
				sudo sed -i "s/boot=casper/file=\/cdrom\/preseed\/${PRESEED_SEED} boot=casper/" iso-directory-structure/boot/grub/grub.cfg
			else
				sudo sed -i "s/linux\(\s*\)\/casper\/\(\S*\)\(\s*\)/linux\1\/casper\/\2\3file=\/cdrom\/preseed\/${PRESEED_SEED}\3/" iso-directory-structure/boot/grub/grub.cfg
			fi
		fi
		# and for completeness
		if (! grep -sq ${PRESEED_SEED} iso-directory-structure/boot/grub/loopback.cfg); then
			if ${BOOT_CASPER}; then
				sudo sed -i "s/boot=casper/file=\/cdrom\/preseed\/${PRESEED_SEED} boot=casper/" iso-directory-structure/boot/grub/loopback.cfg
			else
				sudo sed -i "s/linux\(\s*\)\/casper\/\(\S*\)\(\s*\)/linux\1\/casper\/\2\3file=\/cdrom\/preseed\/${PRESEED_SEED}\3/" iso-directory-structure/boot/grub/loopback.cfg
			fi
		fi
		sudo mkdir iso-refind
		# add 32-bit GRUB bootloader as cannot use the 32-bit rEFInd to boot a 64-bit kernel
		sudo cp grub/bootia32.efi iso-refind
		sudo cp -a grub/i386-efi iso-directory-structure/boot/grub
		sudo sed -i '/linux/i \\tsearch --no-floppy --label LINUXIUMISO --set' iso-directory-structure/boot/grub/grub.cfg
		if [ "${DISTRO_RELEASE}" != "21.10" -a "${DISTRO_RELEASE}" != "21.04" -a "${DISTRO_RELEASE}" != "20.10" ]; then
